odedObsCohortDefinition id=\"1\" uuid=\"91d377c1-9b49-45de-96b7-faf2ca27e2c4\" retired=\"false\">  <name>Tuberculosis Drug Sensitivity Test</name>  <description>Tuberculosis Drug Sensitivity Test</description>    <dateCreated id=\"3\">2011-06-16 09:51:02 EST</dateCreated>  <parameters id=\"4\"/>  <timeModifier>NO</timeModifier>  <question id=\"5\" uuid=\"31befcf4-0370-102d-b0e3-001ec94a0cc1\"/></org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition>','2011-06-16 10:51:02',3,NULL,NULL,0,NULL,NULL,NULL,'91d377c1-9b49-45de-96b7-faf2ca27e2c4'),(86,'Weights for patients','','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"5b92e70b-a162-4db6-ac64-57f960bbe833\" retired=\"false\">\n  <name>Weights for patients</name>\n  <description></description>\n  \n  <dateCreated id=\"3\">2011-12-27 12:34:17 EST</dateCreated>\n  \n  <dateChanged id=\"4\">2012-01-09 10:28:54 EST</dateChanged>\n  <parameters id=\"5\"/>\n  <id>86</id>\n  <sqlQuery>SELECT i.identifier zl_emr_id, n.given_name, n.family_name, wt.value_numeric last_weight, wt.obs_datetime last_weight_date&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person_name n ON p.patient_id = n.person_id AND n.voided = 0&#xd;\n&#xd;\nINNER JOIN patient_identifier i ON p.patient_id = i.patient_id AND i.voided = 0 AND identifier_type = 8&#xd;\n&#xd;\nINNER JOIN (SELECT person_id, value_numeric, obs_datetime FROM obs WHERE concept_id = 5089 AND voided = 0 ORDER BY obs_datetime DESC) wt ON p.patient_id = wt.person_id&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY p.patient_id;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2011-12-27 12:34:17',3,'2012-01-09 10:28:54',3,0,NULL,NULL,NULL,'5b92e70b-a162-4db6-ac64-57f960bbe833'),(87,'Weights