ataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"3e9d493b-99c4-491c-bc16-789ae9da40e5\" retired=\"false\">\n  <name>POC software activity dataset</name>\n  <description>List of Point of Care software activities during a specific period of time.  This should not be used for patient information, but indicates cards and labels printed, and various tasks performed in the software.</description>\n  \n  <dateCreated id=\"3\">2012-02-09 15:43:47 EST</dateCreated>\n  \n  <dateChanged id=\"5\">2012-03-28 15:52:22 EDT</dateChanged>\n  <parameters id=\"6\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>128</id>\n  <sqlQuery>select activity, count(id) &#xd;\n  from patientregistration_user_activity &#xd;\n where date(activity_datetime) between date(:startDate) and date(:endDate) &#xd;\n group by activity;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-02-09 15:43:47',3,'2012-03-28 15:52:22',3,0,NULL,NULL,NULL,'3e9d493b-99c4-491c-bc16-789ae9da40e5'),(129,'POC software activity report','Point of Care activity report at Lacolline.  This report shows where the software module performed different tasks, but should not be used for patient-centric data.','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org