2b9f8-f59a-46bf-bbfa-fcdf2a5f4fb2'),(132,'List of primary care visit by day','List of primary care visit by day','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"b7a940d9-7f30-4e1e-844e-9c53b9f47578\" retired=\"false\">  <name>List of primary care visit by day</name>  <description>List of primary care visit by day</description>    <dateCreated id=\"3\">2012-02-28 17:48:00 EST</dateCreated>    <dateChanged id=\"4\">2012-02-28 17:49:40 EST</dateChanged>  <parameters id=\"5\"/>  <id>132</id>  <query>SELECT distinct(p.patient_id) &#xd;FROM patient;</query></org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2012-02-28 17:48:00',3,'2012-02-28 17:52:45',3,0,NULL,NULL,NULL,'b7a940d9-7f30-4e1e-844e-9c53b9f47578'),(133,'No diagnosis entered for that visit dataset','list of patients at Lacolline who have been consulted by a physician but don\'t have any diagnosis entered.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"c03f0248-a0c6-4a5d-b980-83c8cf376f93\" retired=\"false\">\n  <name>No diagnosis entered for that visit dataset</name>\n  <description>list of patients at Lacolline who have been consulted by a physician but don&apos;t have any diagnosis entered.</description>\n  \n  <dateCreated id=\"3\">2012-02-28 17:55:40 EST</dateCreated>\n  \n  <dateChanged id=\"4\">2012-03-30 15:26:40 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>133</id>\n  <sqlQuery>select distinct(p.patient_id) as &apos;ID Patient&apos;, &#xd;\n       (select max(identifier) from patient_identifier &#xd;\n        where patient_id=p.patient_id and identifier_type=8 and voided = 0) as &apos;ZL EMR ID&apos;,&#xd;\n       (select MAX(identifier) from patient_identifier where patient_id=p.patient_id &#xd;\n        and identifier_type=11 and voided = 0) AS &apos;Numero Dossier&apos;, &#xd;\n       n.given_name as Prenom, n.family_name as Nom, &#xd;\n       e.encounter_datetime as &apos;Date Visite&apos;&#xd;\n      from patient p&#xd;\ninner join encounter e on e.patient_id = p.patient_id and e.voided = 0&#xd;\ninner join encounter_type et on et.encounter_type_id = e.encounter_type&#xd;\ninner join person_name n on n.person_id = p.patient_id&#xd;\nwhere encounter_type_id = 13&#xd;\n  and date(e.encounter_datetime) between date(:startDate) and date(:endDate)&#xd;\n  and p.voided = 0 &#xd;\n  and not exists(select p.patient_id&#xd;\n                       from patient pa&#xd;\n                 inner join encounter en on en.patient_id = pa.patient_id&#xd;\n                      where en.encounter_type = 14&#xd;\n                        and pa.patient_id = p.patient_id&#xd;\n                 and date(en.encounter_datetime) = date(en.encounter_datetime))&#xd;\norder by date(e.encounter_datetime), e.encounter_type asc;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-02-28 17:55:40',3,'2012-03-30 15:26:40',3,0,NULL,NULL,NULL,'c03f0248-a0c6-4a5d-b980-83c8cf376f93'),(134,'MSPP Primary care accounting report','MSPP report of all patients with payment information.