"14\" uuid=\"d62a09f0-ab36-4368-b258-bbb0caf98ae2\"/>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>paid100Prenup</string>\n            <concept id=\"15\" uuid=\"d8f941c8-4680-4064-a30a-db085fb8c590\"/>\n          </entry>\n          <entry>\n            <string>paid50</string>\n            <concept id=\"16\" uuid=\"eeae516c-9730-462b-bd22-d282ae730f4d\"/>\n          </entry>\n          <entry>\n            <string>exemptPatient</string>\n            <concept id=\"17\" uuid=\"43193c27-9152-45e6-be90-ccc1d8bfe73e\"/>\n          </entry>\n          <entry>\n            <string>paid100Med</string>\n            <concept id=\"18\" uuid=\"9679642e-15e9-4efb-8d4f-236d696f2a9b\"/>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>paid50GrdDental</string>\n            <concept id=\"19\" uuid=\"dfa027d6-6239-4a79-8f39-31b19b3f1b2d\"/>\n          </entry>\n          <entry>\n            <string>receiptNumber</string>\n            <concept id=\"20\" uuid=\"20438dc7-c5b4-4d9c-8480-e888f4795123\"/>\n          </entry>\n          <entry>\n            <string>fonkozePatient</string>\n            <concept id=\"21\" uuid=\"b998d841-3f15-4ce5-b25c-215082a1730a\"/>\n          </entry>\n          <entry>\n            <string>encounterType</string>\n            <encounterType id=\"22\" uuid=\"55a0d3ea-a4d7-4e88-8f01-5aceb2d3c61b\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>paymentInd</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"23\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.CohortIndicatorAndDimensionDataSetDefinition\" id=\"24\" uuid=\"df6cf1c1-8758-422e-bbfb-90dd6e9ad837\"/>\n        <parameterMappings id=\"25\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>statReceiptNumber</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"26\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"27\" uuid=\"5466d7ab-5f71-4dc6-aa4f-04612ffd8290\"/>\n        <parameterMappings id=\"28\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>receiptNumber</string>\n            <concept reference=\"20\"/>\n          </entry>\n          <entry>\n            <string>encounterType</string>\n            <encounterType reference=\"22\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-02-29 13:53:50',3,'2012-08-16 16:03:31',3,0,NULL,NULL,NULL,'d0a0cdc5-8572-4d11-804f-a5b6847e22ae'),(135,'Patient Registrations','Returns the internal database ID, EMR ID, gender, birthdate, age at registration, date of registration encounter and full address for patients registered between two dates.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"3b221c2d-bbe3-4034-8803-1ba203cc6ef3\" retired=\"false\">\n  <name>Patient Registrations</name>\n  <description>Returns the internal database ID, EMR ID, gender, birthdate, age at registration, date of registration encounter and full address for patients registered between two dates.</description>\n  \n  <dateCreated id=\"3\">2012-03-01 12:01:01 EST</dateCreated>\n  <dateChanged id=\"4\">2012-03-01 14:12:21 EST</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>135</id>\n  <sqlQuery>SELECT p.patient_id, zl.identifier emr_id, pr.gender, pr.birthdate, ROUND(DATEDIFF(reg.encounter_datetime, pr.birthdate)/365.25,1) age_at_reg, reg.encounter_datetime date_registered, a.state_province departement, a.city_village commune, a.address3 section, a.address1 locality, a.address2 street_address, ma.cnigs_id, ma.ihsi_id, ma.chw_id&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN patient_identifier zl ON p.patient_id = zl.patient_id AND zl.identifier_type = (SELECT patient_identifier_type_id FROM patient_identifier_type WHERE name = &apos;ZL EMR ID&apos;) AND zl.voided = 0&#xd;\n&#xd;\nINNER JOIN encounter reg ON p.patient_id = reg.patient_id AND reg.encounter_type = (SELECT encounter_type_id FROM encounter_type WHERE name = &apos;Patient Registration&apos;) AND reg.date_created BETWEEN :startDate AND :endDate AND reg.voided = 0&#xd;\n&#xd;\nINNER JOIN person_address a ON p.patient_id = a.person_id AND a.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN master_addresses ma ON a.city_village = ma.commune AND a.address3 = ma.section AND a.address1 = ma.localitie&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY p.patient_id;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-01 12:01:01',3,'2012-10-11 13:46:30',3,0,NULL,NULL,NULL,'3b221c2d-bbe3-4034-8803-1ba203cc6ef3'),(136,'Patient registrations export','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"b50aa99e-d4fa-493a-aa0d-09bc6525b7a7\" retired=\"false\">\n  <name>Patient registrations export</name>\n  <description></description>\n  \n  <dateCreated id=\"3\">2012-03-01 12:04:39 EST</dateCreated>\n  \n  <dateChanged id=\"5\">2012-03-28 15:57:06 EDT</dateChanged>\n  <parameters id=\"6\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>136</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"3b221c2d-bbe3-4034-8803-1ba203cc6ef3\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-03-01 12:04:39',3,'2012-03-28 15:57:06',3,0,NULL,NULL,NULL,'b50aa99e-d4fa-493a-aa0d-09bc6525b7a7'),(137,'Primary Care Visit Export','','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"166c9b6d-d766-44ac-84b5-3f3e8326a850\" retired=\"false\">\n  <name>Primary Care Visit Export</name>\n  <description></description>\n  \n  <dateCreated id=\"3\">2012-03-01 12:23:45 EST</dateCreated>\n  \n  <dateChanged id=\"4\">2012-03-01 12:32:38 EST</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>137</id>\n  <sqlQuery>SELECT p.patient_id, pr.gender, pr.birthdate, zl.identifier zlemr, a.state_province department, a.city_village commune, a.neighborhood_cell section, a.address1 locality, a.address2 street_address, e.encounter_id, e.encounter_datetime, cn.name coded_dx, nc.value_text non_coded_dx&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN (SELECT patient_id, identifier FROM patient_identifier WHERE voided = 0 AND identifier_type = 8 ORDER BY date_created DESC) zl ON p.patient_id = zl.patient_id&#xd;\n&#xd;\nINNER JOIN (SELECT * FROM person_address WHERE voided = 0 ORDER BY date_created DESC) a ON p.patient_id = a.person_id&#xd;\n&#xd;\nINNER JOIN encounter e ON p.patient_id = e.patient_id AND e.encounter_type = 14 AND encounter_datetime BETWEEN :startDate AND :endDate AND e.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs c ON e.encounter_id = c.encounter_id AND c.concept_id = 6542 AND c.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name cn ON c.value_coded = cn.concept_id AND cn.locale = &apos;en&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs nc ON e.encounter_id = nc.encounter_id AND nc.concept_id = 6543 AND nc.voided = 0&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY e.encounter_id;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-01 12:23:45',3,'2012-03-01 12:32:38',3,0,NULL,NULL,NULL,'166c9b6d-d766-44ac-84b5-3f3e8326a850'),(141,'List of patients for whom no diagnosis entered for a specific visit','List of patients at Lacolline for whom no diagnosis entered for a specific visit. ','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"3c0455bd-923d-4472-8577-d6f12426844f\" retired=\"false\">\n  <name>List of patients for whom no diagnosis entered for a specific visit</name>\n  <description>List of patients at Lacolline for whom no diagnosis entered for a specific visit. </description>\n  \n  <dateCreated id=\"3\">2012-03-07 16:15:35 EST</dateCreated>\n  \n  <dateChanged id=\"4\">2012-03-08 23:02:00 EST</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>141</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" uuid=\"c03f0248-a0c6-4a5d-b980-83c8cf376f93\"/>\n        <parameterMappings id=\"11\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-03-07 16:15:35',3,'2012-03-08 23:02:00',3,0,NULL,NULL,NULL,'3c0455bd-923d-4472-8577-d6f12426844f'),(142,'Primary Care Visit Export','A simple data export for primary care visits that includes the zlemr ID, encounter info, diagnoses, and username of the clerk who entered the data.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"2c6c2d74-aaeb-4663-b390-1f8a8fb59771\" retired=\"false\">\n  <name>Primary Care Visit Export</name>\n  <description>A simple data export for primary care visits that includes the zlemr ID, encounter info, diagnoses, and username of the clerk who entered the data.</description>\n  \n  <dateCreated id=\"3\">2012-03-13 15:30:56 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-24 17:44:08 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>142</id>\n  <sqlQuery>SELECT zlemr.identifier AS zlemr,&#xd;\n  pr.gender,&#xd;\n  ROUND(DATEDIFF(e.encounter_datetime, pr.birthdate)/365.25, 2) ageAtEncounter,&#xd;\n  DATE(e.encounter_datetime) AS eDate,&#xd;\n  WEEKDAY(e.encounter_datetime) AS eWeekDay,&#xd;\n  MONTH(e.encounter_datetime) AS eMonth,&#xd;\n  dxc_n.name AS codedName,&#xd;\n  dxn.value_text as nonCodedName,&#xd;\n  CONCAT(uname.given_name, &apos; &apos;, uname.family_name, &apos; (&apos;, u.username, &apos;)&apos;) AS UserName&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN patient_identifier zlemr&#xd;\n  ON p.patient_id = zlemr.patient_id&#xd;\n  AND zlemr.identifier_type = 8&#xd;\n  AND zlemr.voided = 0&#xd;\n&#xd;\nINNER JOIN person pr&#xd;\n  ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN encounter e &#xd;\n   ON p.patient_id = e.patient_id &#xd;\n  AND e.encounter_type = 14 &#xd;\n  AND date(e.encounter_datetime) between :startDate and addDate(:endDate,1)&#xd;\n  and e.location_id = :location&#xd;\n  AND e.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs dxc &#xd;\n  ON e.encounter_id = dxc.encounter_id &#xd;\n AND dxc.concept_id = 6542&#xd;\n AND dxc.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name dxc_n &#xd;\n  ON dxc.value_coded = dxc_n.concept_id&#xd;\n AND dxc_n.locale = &apos;en&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs dxn &#xd;\n  ON e.encounter_id = dxn.encounter_id&#xd;\n AND dxn.concept_id = 6543&#xd;\n AND dxn.voided = 0&#xd;\n&#xd;\nINNER JOIN users u&#xd;\n   ON e.creator = u.user_id&#xd;\n&#xd;\nINNER JOIN person_name uname&#xd;\n   ON u.person_id = uname.person_id&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY p.patient_id, date(e.encounter_datetime);</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-13 15:30:56',3,'2012-04-24 17:44:08',3,0,NULL,NULL,NULL,'2c6c2d74-aaeb-4663-b390-1f8a8fb59771'),(143,'Primary care visit export','Excel Export for the \"Primary Care Visit Export\" dataset definition.','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"74c22b39-8e53-4852-9a33-8a5797ba4dd3\" retired=\"false\">\n  <name>Primary care visit export</name>\n  <description>Excel Export for the &quot;Primary Care Visit Export&quot; dataset definition.</description>\n  \n  <dateCreated id=\"3\">2012-03-13 15:32:01 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-24 17:32:11 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>143</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"2c6c2d74-aaeb-4663-b390-1f8a8fb59771\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-03-13 15:32:01',3,'2012-04-24 17:32:11',3,0,NULL,NULL,NULL,'74c22b39-8e53-4852-9a33-8a5797ba4dd3'),(144,'Registration Data Export','An export of all data collected at registration including the address_hierarchy_entry that maps to the patient address.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"5967204e-3142-4a69-8454-b5897cbf8d81\" retired=\"false\">\n  <name>Registration Data Export</name>\n  <description>An export of all data collected at registration including the address_hierarchy_entry that maps to the patient address.</description>\n  \n  <dateCreated id=\"3\">2012-03-13 15:48:26 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-24 17:59:05 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>144</id>\n  <sqlQuery>SELECT zl.identifier zlemr, reg.encounter_datetime, n.given_name, n.family_name, pr.gender, pr.birthdate, ROUND(DATEDIFF(reg.encounter_datetime, pr.birthdate)/365.25, 2) age_at_reg, a.state_province, a.city_village, a.neighborhood_cell, a.address1, a.address2, hierarchy.address_hierarchy_entry_id, t.value, u.username, un.given_name, un.family_name&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN person_name n ON p.patient_id = n.person_id&#xd;\n&#xd;\nINNER JOIN patient_identifier zl ON p.patient_id = zl.patient_id AND zl.identifier_type = 8 AND zl.voided = 0&#xd;\n&#xd;\nINNER JOIN encounter reg ON p.patient_id = reg.patient_id AND reg.encounter_type = 12 AND reg.encounter_datetime BETWEEN DATE(:startDate) AND DATE(:endDate) AND reg.voided = 0&#xd;\n&#xd;\nINNER JOIN person_address a ON p.patient_id = a.person_id AND a.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN person_attribute t ON p.patient_id = t.person_id AND t.person_attribute_type_id = 10 AND t.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN (&#xd;\n&#xd;\n	SELECT l.address_hierarchy_entry_id, CONCAT(d.name, &quot;, &quot;,c.name,&quot;, &quot;,s.name,&quot;, &quot;,l.name) address&#xd;\n&#xd;\n	FROM address_hierarchy_entry d&#xd;\n&#xd;\n	INNER JOIN address_hierarchy_entry c ON d.address_hierarchy_entry_id = c.parent_id AND c.level_id = 3&#xd;\n&#xd;\n	INNER JOIN address_hierarchy_entry s ON c.address_hierarchy_entry_id = s.parent_id AND s.level_id = 4&#xd;\n&#xd;\n	INNER JOIN address_hierarchy_entry l ON s.address_hierarchy_entry_id = l.parent_id AND l.level_id = 5&#xd;\n&#xd;\n	GROUP BY l.address_hierarchy_entry_id&#xd;\n	&#xd;\n	) hierarchy ON CONCAT(a.state_province,&quot;, &quot;,a.city_village,&quot;, &quot;, a.neighborhood_cell,&quot;, &quot;,a.address1) = hierarchy.address&#xd;\n&#xd;\nINNER JOIN users u ON reg.creator = u.user_id&#xd;\n&#xd;\nINNER JOIN person_name un ON u.person_id = un.person_id&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY p.patient_id;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-13 15:48:26',3,'2012-04-24 17:59:05',3,0,NULL,NULL,NULL,'5967204e-3142-4a69-8454-b5897cbf8d81'),(145,'Registration Data Export','An excel export for the \"Registration Data Export\" dataset definition, which includes a mapping of registration date to the address hierarchy ID.','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"7b71d679-c3a2-41c4-a6a4-8f8aea518ccd\" retired=\"false\">\n  <name>Registration Data Export</name>\n  <description>An excel export for the &quot;Registration Data Export&quot; dataset definition, which includes a mapping of registration date to the address hierarchy ID.</description>\n  \n  <dateCreated id=\"3\">2012-03-13 15:49:55 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-03-13 15:51:04 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>145</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" uuid=\"5967204e-3142-4a69-8454-b5897cbf8d81\"/>\n        <parameterMappings id=\"11\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-03-13 15:49:55',3,'2012-03-13 15:51:04',3,0,NULL,NULL,NULL,'7b71d679-c3a2-41c4-a6a4-8f8aea518ccd'),(146,'Reception Data Export','An export of all data collected during the Reception encounter, including the Dossier number, if it was created that day.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"2975baf0-1ab4-4c58-aca9-f4f7b7d9301f\" retired=\"false\">\n  <name>Reception Data Export</name>\n  <description>An export of all data collected during the Reception encounter, including the Dossier number, if it was created that day.</description>\n  \n  <dateCreated id=\"3\">2012-03-13 15:53:22 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-24 17:48:52 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>146</id>\n  <sqlQuery>select zlemr.identifier AS zlemr,&#xd;\n  pr.gender,&#xd;\n  ROUND(DATEDIFF(e.encounter_datetime, pr.birthdate)/365.25, 2) ageAtEncounter,&#xd;\n  DATE(e.encounter_datetime) AS eDate,&#xd;\n  WEEKDAY(e.encounter_datetime) AS eWeekDay,&#xd;\n  MONTH(e.encounter_datetime) AS eMonth,&#xd;\n  e.encounter_datetime,&#xd;\n  dos.identifier AS dossierNo,&#xd;\n  pmt_n.name AS paymentStatus,&#xd;\n  receipt.value_text AS receiptNo,&#xd;\n  CONCAT(uname.given_name, &apos; &apos;, uname.family_name, &apos; (&apos;, u.username, &apos;)&apos;) as UserName&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN patient_identifier zlemr&#xd;\n  ON p.patient_id = zlemr.patient_id&#xd;\n  AND zlemr.identifier_type = 8&#xd;\n  AND zlemr.voided = 0&#xd;\n&#xd;\nINNER JOIN person pr&#xd;\n  ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN encounter e&#xd;\n   on p.patient_id = e.patient_id&#xd;\n  and e.encounter_type = 13&#xd;\n  and date(e.encounter_datetime) between :startDate and addDate(:endDate,1)&#xd;\n  and e.location_id = :location&#xd;\n  and e.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN patient_identifier dos&#xd;\n  on p.patient_id = dos.patient_id&#xd;\n and dos.identifier_type = 11&#xd;\n and dos.voided = 0&#xd;\n AND DATE(dos.date_created) = DATE(e.encounter_datetime)&#xd;\n&#xd;\nLEFT OUTER JOIN obs pmt &#xd;\n  on e.encounter_id = pmt.encounter_id&#xd;\n and pmt.concept_id = 6537&#xd;\n and pmt.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name pmt_n&#xd;\n  on pmt.value_coded = pmt_n.concept_id &#xd;\n and pmt_n.locale = &apos;en&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs receipt &#xd;\n  on e.encounter_id = receipt.encounter_id &#xd;\n and receipt.concept_id = 6541&#xd;\n and receipt.voided = 0&#xd;\n&#xd;\nINNER JOIN users u &#xd;\n   ON e.creator = u.user_id&#xd;\n&#xd;\nINNER JOIN person_name uname &#xd;\n   on u.person_id = uname.person_id&#xd;\n&#xd;\nwhere p.voided = 0&#xd;\n&#xd;\ngroup by p.patient_id, date(e.encounter_datetime)&#xd;\norder by e.encounter_datetime;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-13 15:53:22',3,'2012-04-24 17:48:52',3,0,NULL,NULL,NULL,'2975baf0-1ab4-4c58-aca9-f4f7b7d9301f'),(147,'Reception Data Export','Data export for the dataset \"Reception Data Export\"','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"4ff92bd5-66a6-411c-b791-22b4a01a2790\" retired=\"false\">\n  <name>Reception Data Export</name>\n  <description>Data export for the dataset &quot;Reception Data Export&quot;</description>\n  \n  <dateCreated id=\"3\">2012-03-13 15:54:34 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-24 17:49:59 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>147</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"2975baf0-1ab4-4c58-aca9-f4f7b7d9301f\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-03-13 15:54:34',3,'2012-04-24 17:49:59',3,0,NULL,NULL,NULL,'4ff92bd5-66a6-411c-b791-22b4a01a2790'),(148,'Registration User Activity dataset','Dataset grouping user activities that are part of a group including the task \"Registration Task Create Patient Initiated\".','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"4670a2da-f055-45b6-9c3c-048b04e55080\" retired=\"false\">\n  <name>Registration User Activity dataset</name>\n  <description>Dataset grouping user activities that are part of a group including the task &quot;Registration Task Create Patient Initiated&quot;.</description>\n  \n  <dateCreated id=\"3\">2012-03-13 15:56:33 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-03-13 15:57:08 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>148</id>\n  <sqlQuery>SELECT rs.id, rs.activity_datetime start, zlemr.activity_datetime zlemr, cm.activity_datetime completed, pr.activity print, pr.activity_datetime print_time, u.username, un.given_name, un.family_name&#xd;\n&#xd;\nFROM patientregistration_user_activity rs&#xd;\n&#xd;\nLEFT OUTER JOIN patientregistration_user_activity zlemr ON rs.activity_group = zlemr.activity_group AND zlemr.activity = &apos;Registration Task New ZL EMR ID Created&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN patientregistration_user_activity cm ON rs.activity_group = cm.activity_group AND cm.activity = &apos;Registration Task Completed&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN patientregistration_user_activity pr ON rs.activity_group = pr.activity_group AND pr.activity IN (&apos;ID Card Printing Failed&apos;, &apos;ID Card Printing Successful&apos;)&#xd;\n&#xd;\nINNER JOIN users u ON rs.user_id = u.user_id&#xd;\n&#xd;\nINNER JOIN person_name un ON u.person_id = un.person_id&#xd;\n&#xd;\nWHERE rs.activity = &apos;Registration Task Create Patient Initiated&apos; AND rs.activity_datetime BETWEEN DATE(:startDate) AND DATE(:endDate)&#xd;\n&#xd;\nGROUP BY rs.activity_group;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-13 15:56:33',3,'2012-03-13 15:57:08',3,0,NULL,NULL,NULL,'4670a2da-f055-45b6-9c3c-048b04e55080'),(149,'Registration User Activity data export','Data export for the dataset \"Registration User Activity dataset\"','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"bb61de7e-cb4d-4a3c-a482-f4945ca328c7\" retired=\"false\">\n  <name>Registration User Activity data export</name>\n  <description>Data export for the dataset &quot;Registration User Activity dataset&quot;</description>\n  \n  <dateCreated id=\"3\">2012-03-13 15:57:49 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-03-13 15:58:19 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>149</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" uuid=\"4670a2da-f055-45b6-9c3c-048b04e55080\"/>\n        <parameterMappings id=\"11\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-03-13 15:57:49',3,'2012-03-13 15:58:19',3,0,NULL,NULL,NULL,'bb61de7e-cb4d-4a3c-a482-f4945ca328c7'),(150,'Master Address List','Straight up data export for the master_addresses table (the master address table that address_hierarchy_entry comes from)','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"06c3929a-b03d-4ccd-9d4c-4825335a7808\" retired=\"false\">\n  <name>Master Address List</name>\n  <description>Straight up data export for the master_addresses table (the master address table that address_hierarchy_entry comes from)</description>\n  \n  <dateCreated id=\"3\">2012-03-13 15:59:53 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-03-14 09:49:34 EDT</dateChanged>\n  <parameters id=\"5\"/>\n  <id>150</id>\n  <sqlQuery>SELECT ma.*, hierarchy.address_hierarchy_entry_id&#xd;\n&#xd;\nFROM master_addresses ma&#xd;\n&#xd;\nLEFT OUTER JOIN (&#xd;\n&#xd;\n	SELECT l.address_hierarchy_entry_id, CONCAT(d.name, &quot;, &quot;,c.name,&quot;, &quot;,s.name,&quot;, &quot;,l.name) address&#xd;\n&#xd;\n	FROM address_hierarchy_entry d&#xd;\n&#xd;\n	INNER JOIN address_hierarchy_entry c ON d.address_hierarchy_entry_id = c.parent_id AND c.level_id = 3&#xd;\n&#xd;\n	INNER JOIN address_hierarchy_entry s ON c.address_hierarchy_entry_id = s.parent_id AND s.level_id = 4&#xd;\n&#xd;\n	INNER JOIN address_hierarchy_entry l ON s.address_hierarchy_entry_id = l.parent_id AND l.level_id = 5&#xd;\n&#xd;\n	GROUP BY l.address_hierarchy_entry_id&#xd;\n	&#xd;\n	) hierarchy ON CONCAT(ma.departement,&quot;, &quot;,ma.commune,&quot;, &quot;, ma.section,&quot;, &quot;,ma.localitie) = hierarchy.address&#xd;\n	&#xd;\n;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-13 15:59:53',3,'2012-03-14 09:49:34',3,0,NULL,NULL,NULL,'06c3929a-b03d-4ccd-9d4c-4825335a7808'),(151,'Master Address List','Export of the table \"Master Address List\"','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"3aa6d6c3-2b65-47b1-9df9-9b3f647b32b2\" retired=\"false\">\n  <name>Master Address List</name>\n  <description>Export of the table &quot;Master Address List&quot;</description>\n  \n  <dateCreated id=\"3\">2012-03-13 16:00:17 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-03-13 16:00:28 EDT</dateChanged>\n  <parameters id=\"5\"/>\n  <id>151</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" uuid=\"06c3929a-b03d-4ccd-9d4c-4825335a7808\"/>\n        <parameterMappings id=\"9\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-03-13 16:00:17',3,'2012-03-13 16:00:28',3,0,NULL,NULL,NULL,'3aa6d6c3-2b65-47b1-9df9-9b3f647b32b2'),(152,'Top coded primary care diagnoses within a period','','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"21e9d3c4-9678-433c-9bff-6479a8e35e39\" retired=\"false\">\n  <name>Top coded primary care diagnoses within a period</name>\n  <description></description>\n  \n  <dateCreated id=\"3\">2012-03-14 00:58:43 EDT</dateCreated>\n  \n  <dateChanged id=\"5\">2012-03-16 12:03:41 EDT</dateChanged>\n  <parameters id=\"6\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>minAge</name>\n      <label>minAge</label>\n      <type>java.lang.Integer</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>maxAge</name>\n      <label>maxAge</label>\n      <type>java.lang.Integer</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>152</id>\n  <sqlQuery>SELECT * FROM (SELECT n.name dx, COUNT(distinct(o.obs_id)) num&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN obs o ON p.patient_id = o.person_id AND o.concept_id = 6542 AND o.voided = 0 AND o.obs_datetime BETWEEN :startDate AND :endDate&#xd;\n&#xd;\nINNER JOIN concept_name n ON o.value_coded = n.concept_id AND n.locale = &apos;en&apos;&#xd;\n&#xd;\nINNER JOIN concept_name_tag_map cntm &#xd;\n on n.concept_name_id = cntm.concept_name_id&#xd;\n and cntm.concept_name_tag_id = 4 &#xd;\n&#xd;\nWHERE p.voided = 0 AND DATEDIFF(o.obs_datetime, pr.birthdate)/365.25 BETWEEN :minAge AND :maxAge&#xd;\n&#xd;\nGROUP BY o.value_coded) list ORDER by num DESC;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-14 00:58:43',3,'2012-03-16 12:03:41',3,0,NULL,NULL,NULL,'21e9d3c4-9678-433c-9bff-6479a8e35e39'),(153,'Primary care coded diagnoses (most popular)','Top coded primary care diagnoses within a period','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"661f5c61-656f-44e7-a212-9a36d2066f6b\" retired=\"false\">\n  <name>Primary care coded diagnoses (most popular)</name>\n  <description>Top coded primary care diagnoses within a period</description>\n  \n  <dateCreated id=\"3\">2012-03-14 00:59:25 EDT</dateCreated>\n  \n  <dateChanged id=\"5\">2012-03-29 14:23:12 EDT</dateChanged>\n  <parameters id=\"6\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>minAge</name>\n      <label>minAge</label>\n      <type>java.lang.Integer</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>maxAge</name>\n      <label>maxAge</label>\n      <type>java.lang.Integer</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>153</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"11\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"12\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"13\" uuid=\"21e9d3c4-9678-433c-9bff-6479a8e35e39\"/>\n        <parameterMappings id=\"14\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-03-14 00:59:25',3,'2012-03-29 14:23:12',3,0,NULL,NULL,NULL,'661f5c61-656f-44e7-a212-9a36d2066f6b'),(154,'Top addresses by commune and localitie','','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"54d0ab2e-45c5-44c0-a1bd-55162babeaa4\" retired=\"false\">\n  <name>Top addresses by commune and localitie</name>\n  <description></description>\n  \n  <dateCreated id=\"3\">2012-03-14 01:55:17 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-03-14 01:55:47 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>154</id>\n  <sqlQuery>SELECT CONCAT(commune, &quot; - &quot;, localitie), num FROM (&#xd;\n&#xd;\nSELECT departement, commune, section, localitie, COUNT(patient_id) num FROM&#xd;\n&#xd;\n(SELECT p.patient_id, a.state_province departement, a.city_village commune, a.neighborhood_cell section, a.address1 localitie&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN encounter r ON p.patient_id = r.patient_id AND r.encounter_type = 12 AND r.encounter_datetime BETWEEN DATE(:startDate) AND DATE(:endDate) AND r.voided = 0&#xd;\n&#xd;\nINNER JOIN person_address a ON p.patient_id = a.person_id AND a.voided = 0&#xd;\n&#xd;\nWHERE p.voided = 0) addresses GROUP BY departement, commune, section, localitie) list&#xd;\n&#xd;\nORDER BY num DESC;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-14 01:55:17',3,'2012-03-14 01:55:47',3,0,NULL,NULL,NULL,'54d0ab2e-45c5-44c0-a1bd-55162babeaa4'),(155,'Addresses by commune and locality (most popular)','Top addresses by commune and locality','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"2a4d7dec-41ae-43d2-b851-0e3bf065e726\" retired=\"false\">\n  <name>Addresses by commune and locality (most popular)</name>\n  <description>Top addresses by commune and locality</description>\n  \n  <dateCreated id=\"3\">2012-03-14 01:56:31 EDT</dateCreated>\n  \n  <dateChanged id=\"5\">2012-03-29 14:24:19 EDT</dateChanged>\n  <parameters id=\"6\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>155</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"54d0ab2e-45c5-44c0-a1bd-55162babeaa4\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-03-14 01:56:31',3,'2012-03-29 14:24:19',3,0,NULL,NULL,NULL,'2a4d7dec-41ae-43d2-b851-0e3bf065e726'),(156,'Receipt number statistics','Statistics about receipt numbers from payment for primary care visit, including minimum and maximum values.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"5466d7ab-5f71-4dc6-aa4f-04612ffd8290\" retired=\"false\">\n  <name>Receipt number statistics</name>\n  <description>Statistics about receipt numbers from payment for primary care visit, including minimum and maximum values.</description>\n  \n  <dateCreated id=\"3\">2012-03-14 13:28:58 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-08-10 17:37:51 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>encounterType</name>\n      <label>Encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>receiptNumber</name>\n      <label>Receipt number</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>156</id>\n  <sqlQuery>select min(cast(o.value_text as unsigned)) as minReceiptNum,&#xd;\n       max(cast(o.value_text as unsigned)) as maxReceiptNum&#xd;\nfrom obs o, encounter e &#xd;\nwhere date(o.obs_datetime) between :startDate and addDate(:endDate,1)&#xd;\n  and e.location_id = :location &#xd;\n  and o.encounter_id = e.encounter_id &#xd;\n  and e.encounter_type = :encounterType&#xd;\n  and o.concept_id = :receiptNumber  &#xd;\n  and o.voided = 0&#xd;\n  and e.voided = 0;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-14 13:28:58',3,'2012-08-29 18:30:52',3,0,NULL,NULL,NULL,'5466d7ab-5f71-4dc6-aa4f-04612ffd8290'),(158,'Outpatient payment receipts','This is for creating a list of payment receipts for outpatient (initially in Lacolline)','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"8336eb2a-f711-43c9-8c44-9fd21e46fbe3\" retired=\"false\">\n  <name>Outpatient payment receipts</name>\n  <description>This is for creating a list of payment receipts for outpatient (initially in Lacolline)</description>\n  \n  <dateCreated id=\"3\">2012-03-14 13:32:22 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-08-16 16:01:06 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>encounterType</name>\n      <label>Encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>receiptNumber</name>\n      <label>Receipt number</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"11\">\n      <name>fonkozePatient</name>\n      <label>Fonkoze patient</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"12\">\n      <name>patientNStaff</name>\n      <label>Patient and staff member</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"13\">\n      <name>exemptPatient</name>\n      <label>Exempt patient</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"14\">\n      <name>paid50</name>\n      <label>Paid 50 gdes</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"15\">\n      <name>paid100Med</name>\n      <label>Paid 100 gdes for medical certificate</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"16\">\n      <name>paid100Prenup</name>\n      <label>Paid 100 for prenup certificate</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"17\">\n      <name>paid50GrdDental</name>\n      <label>Paid 50 gourdes for dental</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>158</id>\n  <sqlQuery>select distinct &#xd;\n    case coalesce(value_text, value_coded)&#xd;\n    when value_coded then &#xd;\n    (&#xd;\n        select distinct(cast(value_text as unsigned)) &#xd;\n        from obs &#xd;\n        where obs.concept_id = :receiptNumber&#xd;\n          and obs.encounter_id = o.encounter_id &#xd;\n    )&#xd;\n    else cast(value_text as unsigned)  &#xd;\n    end as receiptNo, &#xd;\n     case &#xd;\n        when o.value_coded in (:fonkozePatient, :patientNStaff, :exemptPatient) then &apos;Exonéré&apos;&#xd;\n        when o.value_coded in (:paid50, :paid50GrdDental, :paid100Med, :paid100Prenup) then &apos;Payés&apos;&#xd;\n    end as paymentType,&#xd;\n     case &#xd;\n        when o.value_coded in (:fonkozePatient, :patientNStaff, :exemptPatient) then 0&#xd;\n        when o.value_coded in (:paid50, :paid50GrdDental) then 50&#xd;\n    end as paymentCost,&#xd;\n     case &#xd;\n        when o.value_coded = :paid100Med then 100&#xd;\n    end as medCertPaymentCost,&#xd;\n     case &#xd;\n        when o.value_coded = :paid100Prenup then 100&#xd;\n    end as prenupCertPaymentCost,&#xd;\n    case &#xd;\n        when o.value_coded in (:paid100Med, :paid100Prenup) then 100&#xd;\n        when o.value_coded in (:paid50, :paid50GrdDental) then 50&#xd;\n    end as totalPaymentCost&#xd;\nfrom obs o, encounter e  &#xd;\nwhere date(o.obs_datetime) between :startDate and addDate(:endDate,1)&#xd;\n  and e.location_id = :location &#xd;\n  and o.encounter_id = e.encounter_id &#xd;\n  and e.encounter_type = :encounterType&#xd;\n  and o.concept_id != :receiptNumber&#xd;\n  and o.voided = 0&#xd;\n  and e.voided = 0&#xd;\norder by ReceiptNo;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-03-14 13:32:22',3,'2012-08-16 16:01:06',3,0,NULL,NULL,NULL,'8336eb2a-f711-43c9-8c44-9fd21e46fbe3'),(159,'Patients exempt from payment','These patients don\'t need to make a payment since they are exempt','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition id=\"1\" uuid=\"b6de43fa-4a5d-4878-bbcb-7c471b45aa15\" retired=\"false\">\n  <name>Patients exempt from payment</name>\n  <description>These patients don&apos;t need to make a payment since they are exempt</description>\n  \n  <dateCreated id=\"3\">2012-03-14 14:01:07 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-03-14 14:02:53 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>onOrAfter</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>onOrBefore</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>locationList</name>\n      <label>location</label>\n      <type>org.openmrs.Location</type>\n      <collectionType>java.util.List</collectionType>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>159</id>\n  <timeModifier>LAST</timeModifier>\n  <question id=\"9\" uuid=\"dbbd4c42-3e62-4c2e-9e5f-f1e7609a9f01\"/>\n  <encounterTypeList id=\"10\">\n    <encounterType id=\"11\" uuid=\"55a0d3ea-a4d7-4e88-8f01-5aceb2d3c61b\"/>\n  </encounterTypeList>\n  <operator>IN</op