.report.definition.ReportDefinition>','2012-04-18 16:22:32',3,'2012-04-23 17:58:17',3,0,NULL,NULL,NULL,'6761a82c-ac5a-4251-a756-9b37d124a895'),(189,'Has a specific encounter between dates','','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.EncounterCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.EncounterCohortDefinition id=\"1\" uuid=\"8897d9c7-a8e5-4f7a-89cf-bcffafaacb3a\" retired=\"false\">  <name>Has a specific encounter between dates</name>  <description></description>    <dateCreated id=\"3\">2012-04-19 11:34:51 EDT</dateCreated>    <dateChanged id=\"4\">2012-04-19 11:36:58 EDT</dateChanged>  <parameters id=\"5\">    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">      <name>encounterTypeList</name>      <label>type</label>      <type>org.openmrs.EncounterType</type>      <collectionType>java.util.List</collectionType>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">      <name>locationList</name>      <label>location</label>      <type>org.openmrs.Location</type>      <collectionType>java.util.List</collectionType>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">      <name>onOrAfter</name>      <label>startDate</label>      <type>java.util.Date</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">      <name>onOrBefore</name>      <label>endDate</label>      <type>java.util.Date</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>  </parameters>  <id>186</id>  <timeQualifier>ANY</timeQualifier>  <returnInverse>false</returnInverse></org.openmrs.module.reporting.cohort.definition.EncounterCohortDefiniti