     <entry>        <string>locationList</string>        <string>${location}</string>      </entry>      <entry>        <string>encounterTypeList</string>        <string>${type}</string>      </entry>      <entry>        <string>onOrAfter</string>        <string>${startDate}</string>      </entry>    </parameterMappings>  </cohortDefinition></org.openmrs.module.reporting.indicator.CohortIndicator>','2012-04-19 11:35:10',3,'2012-04-19 11:41:59',3,0,NULL,NULL,NULL,'c5e77d18-afda-4b9f-b90f-406538da7c59'),(191,'Primary care reception visit volume by day','Daily report showing the number of patients seen at reception per day. Used by M&E supervisor to check on status of the Primary Care system remotely.  ','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"5841d68e-e10c-4dfb-9e42-92a25730f6e3\" retired=\"false\">\n  <name>Primary care reception visit volume by day</name>\n  <description>Daily report showing the number of patients seen at reception per day. Used by M&amp;E supervisor to check on status of the Primary Care system remotely.  </description>\n  \n  <dateCreated id=\"3\">2012-04-19 11:38:45 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-19 11:59:04 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>191</id>\n  <sqlQuery>select date_format(e.encounter_datetime, &apos;%c-%e&apos; ) as byDay, count(*)&#xd;\nfrom patient p&#xd;\n&#xd;\nINNER JOIN encounter e&#xd;\n   on p.patient_id = e.patient_id&#xd;\n  and e.encounter_type = 13&#xd;\n  and date(e.encounter_datetime) between :startDate and addDate(:endDate,1)&#xd;\n  and e.location_id = :location&#xd;\n  and e.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs pmt &#xd;\n  on e.encounter_id = pmt.encounter_id&#xd;\n and pmt.concept_id = 6537&#xd;\n and pmt.voided = 0&#xd;\n&#xd;\nwhere p.voided = 0&#xd;\n&#xd;\ngroup by date(e.encounter_datetime);</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-19 11:38:45',3,'2012-04-19 11:59:04',3,0,NULL,NULL,NULL,'5841d68e-e10c-4dfb-9e42-92a25730f6e3'),(192,'Hostname','Show the hostname of the server.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"254fbbbf-6e9f-49aa-a3ec-8c5b042cde82\" retired=\"false\">\n  <name>Hostname</name>\n  <description>Show the hostname of the server.</description>\n  \n  <dateCreated id=\"3\">2012-04-19 15:36:47 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-19 15:44:51 EDT</dateChanged>\n  <parameters id=\"5\"/>\n  <id>192</id>\n  <sqlQuery>select variable_value as servername &#xd;\n  from information_schema.global_variables&#xd;\n where variable_name like &apos;hostname&apos;;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-19 15:36:47',3,'2012-04-19 15:44:51',3,0,NULL,NULL,NULL,'254fbbbf-6e9f-49aa-a3ec-8c5b042cde82'),(193,'Primary care reception visit volume previous week','Visit volume from the 7 days earlier.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"86f011d3-a6dd-466f-bec3-31376b88c2de\" retired=\"false\">\n  <name>Primary care reception visit volume previous week</name>\n  <description>Visit volume from the 7 days earlier.</description>\n  \n  <dateCreated id=\"3\">2012-04-19 18:17:30 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-23 17:01:42 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>193</id>\n  <sqlQuery>select hour(e.encounter_datetime) as byHourLastWeek, &#xd;\n       count(*) as freqLastWeek&#xd;\nfrom patient p&#xd;\n&#xd;\nINNER JOIN encounter e&#xd;\n   on p.patient_id = e.patient_id&#xd;\n  and e.encounter_type = 13&#xd;\n  and date(e.encounter_datetime) = subDate(:date,7)&#xd;\n  and e.location_id = :location&#xd;\n  and e.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs pmt &#xd;\n  on e.encounter_id = pmt.encounter_id&#xd;\n and pmt.concept_id = 6537&#xd;\n and pmt.voided = 0&#xd;\n&#xd;\nwhere p.voided = 0&#xd;\n&#xd;\ngroup by hour(e.encounter_datetime);</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-19 18:17:30',3,'2012-04-23 17:01:42',3,0,NULL,NULL,NULL,'86f011d3-a6dd-466f-bec3-31376b88c2de'),(194,'Missing encounters per day','Compare patient encounters per day.  Show patients (ZLEMR id, name and gender) for all patients that are missing one of the 3 encounters (reception, registration or visit).','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"3303f85d-9d3c-4555-98b5-548048b3af1e\" retired=\"false\">\n  <name>Missing encounters per day</name>\n  <description>Compare patient encounters per day.  Show patients (ZLEMR id, name and gender) for all patients that are missing one of the 3 encounters (reception, registration or visit).</description>\n  \n  <dateCreated id=\"3\">2012-04-20 12:03:30 EDT</dateCreated>\n  \n  <dateChanged id=\"5\">2012-07-03 13:48:17 EDT</dateChanged>\n  <parameters id=\"6\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>registrationEncounterType</name>\n      <label>Registration encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>receptionEncounterType</name>\n      <label>Reception encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"11\">\n      <name>primaryCareVisitEncounterType</name>\n      <label>Primary care visit encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"12\">\n      <name>dossierIdType</name>\n      <label>Dossier number type</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"13\">\n      <name>zlIdType</name>\n      <label>zlIdType</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>194</id>\n  <sqlQuery>SELECT dossier.identifier as &apos;Dossier&apos;,&#xd;\n       zl.identifier as &apos;ZL EMR ID&apos;,&#xd;\n       concat(n.given_name, &apos; &apos;, n.family_name) as &apos;Patient nom&apos;,&#xd;\n       concat(&apos;https://&apos;, (select variable_value as servername &#xd;\n                from information_schema.global_variables&#xd;\n               where variable_name like &apos;hostname&apos;), &#xd;\n               &apos;/openmrs/module/patientregistration/workflow/patientDashboard.form?patientId=&apos;, cast(pr.person_id as char(8))) as URL,  &#xd;\n       pr.gender as Sexe, &#xd;\n       date(e.encounter_datetime) as EncounterDate, &#xd;\n       count(case &#xd;\n             when e.encounter_type = :registrationEncounterType &#xd;\n             then e.patient_id &#xd;\n             else null &#xd;\n             end) as &apos;Registration&apos;, &#xd;\n       count(case &#xd;\n             when e.encounter_type = :receptionEncounterType &#xd;\n             then e.patient_id &#xd;\n             else null&#xd;\n             end) as &apos;Reception&apos;, &#xd;\n       count(case &#xd;\n             when e.encounter_type = :primaryCareVisitEncounterType&#xd;\n             then e.patient_id &#xd;\n             else null&#xd;\n             end) as &apos;PrimaryCareVisit&apos;, &#xd;\n       count(*) as TotalVisits&#xd;\n&#xd;\n  from encounter e&#xd;\n&#xd;\nINNER JOIN person pr &#xd;\n   ON e.patient_id = pr.person_id&#xd;\n  and pr.voided = 0&#xd;\n&#xd;\nINNER JOIN person_name n &#xd;\n   ON e.patient_id = n.person_id&#xd;\n  and n.voided = 0&#xd;\n&#xd;\nINNER JOIN patient p &#xd;\n   ON e.patient_id = p.patient_id&#xd;\n  and p.voided = 0&#xd;\n&#xd;\nleft outer JOIN patient_identifier zl &#xd;\n   ON e.patient_id = zl.patient_id&#xd;\n  AND zl.identifier_type = :zlIdType&#xd;\n  AND zl.voided = 0&#xd;\n&#xd;\nleft outer JOIN patient_identifier dossier &#xd;\n   ON e.patient_id = dossier.patient_id&#xd;\n  AND dossier.identifier_type = :dossierIdType&#xd;\n  AND dossier.voided = 0&#xd;\n&#xd;\nwhere e.location_id = :location&#xd;\n  and e.voided = 0&#xd;\n  and date(e.encounter_datetime) = :date&#xd;\n&#xd;\n&#xd;\ngroup by date(e.encounter_datetime), e.patient_id&#xd;\n &#xd;\nhaving Registration &lt;&gt; 1 &#xd;\n    or Reception &lt;&gt; 1&#xd;\n    or PrimaryCareVisit &lt;&gt; 1;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-20 12:03:30',3,'2012-07-03 13:48:17',3,0,NULL,NULL,NULL,'3303f85d-9d3c-4555-98b5-548048b3af1e'),(195,'Seven days earlier','Calculate the 7 days previous to the requested date.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"57ac7f65-1ca5-4e09-8dc1-1cb6cf68b7b3\" retired=\"false\">\n  <name>Seven days earlier</name>\n  <description>Calculate the 7 days previous to the requested date.</description>\n  \n  <dateCreated id=\"3\">2012-04-23 17:45:00 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-23 17:56:18 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>195</id>\n  <sqlQuery>select subdate(date(:date),7) as sevenDaysEarlier&#xd;\nfrom location&#xd;\nlimit 1;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-23 17:45:00',3,'2012-04-23 17:56:18',3,0,NULL,NULL,NULL,'57ac7f65-1ca5-4e09-8dc1-1cb6cf68b7b3'),(196,'Patients with 50 gde payment','The cohort of patients where payment of 50 gde was required.','org.openmrs.module.reporting.indicator.Indicator','org.openmrs.module.reporting.indicator.CohortIndicator','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.indicator.CohortIndicator id=\"1\" uuid=\"d944576f-b898-482c-ba85-f58be5e8a684\" retired=\"false\">\n  <name>Patients with 50 gde payment</name>\n  <description>The cohort of patients where payment of 50 gde was required.</description>\n  \n  <dateCreated id=\"3\">2012-04-24 11:17:05 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-16 14:49:54 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>196</id>\n  <type>COUNT</type>\n  <cohortDefinition id=\"9\">\n    <parameterizable class=\"org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition\" id=\"10\" uuid=\"a3bc7b29-6b45-4983-9f78-6c46c0bc20c4\"/>\n    <parameterMappings id=\"11\">\n      <entry>\n        <string>onOrBefore</string>\n        <string>${endDate}</string>\n      </entry>\n      <entry>\n        <string>locationList</string>\n        <string>${location}</string>\n      </entry>\n      <entry>\n        <string>onOrAfter</string>\n        <string>${startDate}</string>\n      </entry>\n    </parameterMappings>\n  </cohortDefinition>\n</org.openmrs.module.reporting.indicator.CohortIndicator>','2012-04-24 11:17:05',3,'2012-05-16 14:49:54',3,0,NULL,NULL,NULL,'d944576f-b898-482c-ba85-f58be5e8a684'),(197,'Patients with 50 gourdes payment','The cohort of patients where the standard payment was required.','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition id=\"1\" uuid=\"a3bc7b29-6b45-4983-9f78-6c46c0bc20c4\" retired=\"false\">\n  <name>Patients with 50 gourdes payment</name>\n  <description>The cohort of patients where the standard payment was required.</description>\n  \n  <dateCreated id=\"3\">2012-04-24 11:21:02 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-16 14:46:20 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>onOrAfter</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>onOrBefore</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>locationList</name>\n      <label>location</label>\n      <type>org.openmrs.Location</type>\n      <collectionType>java.util.List</collectionType>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>197</id>\n  <timeModifier>LAST</timeModifier>\n  <question id=\"9\" uuid=\"dbbd4c42-3e62-4c2e-9e5f-f1e7609a9f01\"/>\n  <encounterTypeList id=\"10\">\n    <encounterType id=\"11\" uuid=\"55a0d3ea-a4d7-4e88-8f01-5aceb2d3c61b\"/>\n  </encounterTypeList>\n  <operator>IN</operator>\n  <valueList id=\"12\">\n    <concept id=\"13\" uuid=\"eeae516c-9730-462b-bd22-d282ae730f4d\"/>\n  </valueList>\n</org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition>','2012-04-24 11:21:02',3,'2012-05-16 14:46:20',3,0,NULL,NULL,NULL,'a3bc7b29-6b45-4983-9f78-6c46c0bc20c4'),(198,'Patients with 100 gourde payment','The cohort of patients where payment of 100 gde was required and includes payment for medical or prenuptial certificate.','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition id=\"1\" uuid=\"d5148722-a643-4ead-a235-1b13bb4f4ba6\" retired=\"false\">\n  <name>Patients with 100 gourde payment</name>\n  <description>The cohort of patients where payment of 100 gde was required and includes payment for medical or prenuptial certificate.</description>\n  \n  <dateCreated id=\"3\">2012-04-24 11:25:38 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-16 14:47:59 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>onOrAfter</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>onOrBefore</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>locationList</name>\n      <label>location</label>\n      <type>org.openmrs.Location</type>\n      <collectionType>java.util.List</collectionType>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>198</id>\n  <timeModifier>LAST</timeModifier>\n  <question id=\"9\" uuid=\"dbbd4c42-3e62-4c2e-9e5f-f1e7609a9f01\"/>\n  <encounterTypeList id=\"10\">\n    <encounterType id=\"11\" uuid=\"55a0d3ea-a4d7-4e88-8f01-5aceb2d3c61b\"/>\n  </encounterTypeList>\n  <operator>IN</operator>\n  <valueList id=\"12\">\n    <concept id=\"13\" uuid=\"9679642e-15e9-4efb-8d4f-236d696f2a9b\"/>\n    <concept id=\"14\" uuid=\"d8f941c8-4680-4064-a30a-db085fb8c590\"/>\n  </valueList>\n</org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition>','2012-04-24 11:25:38',3,'2012-05-16 14:47:59',3,0,NULL,NULL,NULL,'d5148722-a643-4ead-a235-1b13bb4f4ba6'),(199,'Patients with 100 gde payment','Total number of patients who paid 100 gourde for their visit for medical or prenuptial certificate.','org.openmrs.module.reporting.indicator.Indicator','org.openmrs.module.reporting.indicator.CohortIndicator','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.indicator.CohortIndicator id=\"1\" uuid=\"daa976ac-37a1-4b68-bda7-5ae556098936\" retired=\"false\">\n  <name>Patients with 100 gde payment</name>\n  <description>Total number of patients who paid 100 gourde for their visit for medical or prenuptial certificate.</description>\n  \n  <dateCreated id=\"3\">2012-04-24 11:26:37 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-16 14:54:57 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>199</id>\n  <type>COUNT</type>\n  <cohortDefinition id=\"9\">\n    <parameterizable class=\"org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition\" id=\"10\" uuid=\"d5148722-a643-4ead-a235-1b13bb4f4ba6\"/>\n    <parameterMappings id=\"11\">\n      <entry>\n        <string>onOrBefore</string>\n        <string>${endDate}</string>\n      </entry>\n      <entry>\n        <string>locationList</string>\n        <string>${location}</string>\n      </entry>\n      <entry>\n        <string>onOrAfter</string>\n        <string>${startDate}</string>\n      </entry>\n    </parameterMappings>\n  </cohortDefinition>\n</org.openmrs.module.reporting.indicator.CohortIndicator>','2012-04-24 11:26:37',3,'2012-05-16 14:54:57',3,0,NULL,NULL,NULL,'daa976ac-37a1-4b68-bda7-5ae556098936'),(200,'All outpatients with a monthly visit','The cohort of patients with a visit as an outpatient during a month at a specified health center.','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"d917c47d-70aa-4563-9e61-3c0cfa7977cd\" retired=\"false\">\n  <name>All outpatients with a monthly visit</name>\n  <description>The cohort of patients with a visit as an outpatient during a month at a specified health center.</description>\n  \n  <dateCreated id=\"3\">2012-04-24 15:49:26 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-24 16:12:49 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>200</id>\n  <query>select distinct(e.patient_id)&#xd;\n  from encounter e, patient p &#xd;\n where p.patient_id = e.patient_id&#xd;\n   and date(e.encounter_datetime) &#xd;\n       between date_format(:date, &apos;%Y-%m-01&apos;) &#xd;\n           and date_add(date_format(:date, &apos;%Y-%m-01&apos;), interval 1 month)&#xd;\n   and e.location_id = :location&#xd;\n   and e.voided = 0&#xd;\n   and p.voided = 0</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>','2012-04-24 15:49:26',3,'2012-04-24 16:12:49',3,0,NULL,NULL,NULL,'d917c47d-70aa-4563-9e61-3c0cfa7977cd'),(201,'New patient visits in month','The total number of NEW patients with a visit in the indicated month and health center.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"b1b3c4a7-a7e4-4e4b-bf0b-cb1aea039cad\" retired=\"false\">\n  <name>New patient visits in month</name>\n  <description>The total number of NEW patients with a visit in the indicated month and health center.</description>\n  \n  <dateCreated id=\"3\">2012-04-24 16:16:42 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-01 13:07:01 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>encounterType</name>\n      <label>Encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>201</id>\n  <sqlQuery>select count(*) as newPatientVisit &#xd;\n  from encounter e, patient p &#xd;\n where p.patient_id = e.patient_id&#xd;\n   and e.encounter_datetime &#xd;\n       between date_format(:date, &apos;%Y-%m-01&apos;) &#xd;\n           and adddate(date_format(:date, &apos;%Y-%m-01&apos;), interval 1 month)&#xd;\n   and e.patient_id not in (&#xd;\n         select distinct(e1.patient_id) &#xd;\n           from encounter e1&#xd;\n          where e1.encounter_datetime between date_format(:date, &apos;%Y-01-01&apos;) &#xd;\n                and subdate(date_format(:date, &apos;%Y-%m-01&apos;), interval 1 hour)&#xd;\n            and e1.location_id = :location&#xd;\n            and e1.encounter_type = :encounterType&#xd;\n            and e1.voided = 0)&#xd;\n   and e.location_id = :location&#xd;\n   and e.encounter_type = :encounterType&#xd;\n   and e.voided = 0&#xd;\n   and p.voided = 0</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-24 16:16:42',3,'2012-05-01 13:07:01',3,0,NULL,NULL,NULL,'b1b3c4a7-a7e4-4e4b-bf0b-cb1aea039cad'),(202,'Primary Care Visit - one row per patient per day','Data export including data from registration, reception and primary care encounters, grouped by patient and day.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"8c38a5aa-0606-4b7e-9150-aed865447611\" retired=\"false\">\n  <name>Primary Care Visit - one row per patient per day</name>\n  <description>Data export including data from registration, reception and primary care encounters, grouped by patient and day.</description>\n  \n  <dateCreated id=\"3\">2012-04-24 18:45:17 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-25 18:34:40 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>202</id>\n  <sqlQuery>SELECT zlemr.identifier AS zlemr,&#xd;\n  zlemr.date_created AS zlemrDateCreated,&#xd;\n  IF(DATE(zlemr.date_created) = up.dt, IF(ISNULL(epi.identifier),&quot;New POC&quot;,&quot;New POC - Epi&quot;),IF(ISNULL(epi.identifier),&quot;Return POC&quot;,&quot;Return POC - Epi&quot;)) visit_type,&#xd;\n  epi.identifier epiID,&#xd;\n  pr.gender,&#xd;\n  ROUND(DATEDIFF(up.dt, pr.birthdate)/365.25,2) ageAtEnc, &#xd;\n  MONTH(up.dt) AS eMonth,&#xd;\n  WEEKDAY(up.dt) AS eWeekDay,&#xd;\n  up.dt AS eDate,&#xd;\n  reg.encounter_datetime regDt,&#xd;\n  CONCAT(reg_un.given_name, &apos; &apos;, reg_un.family_name, &apos; (&apos;, reg_u.username, &apos;)&apos;) AS regUserName,&#xd;\n  print.value_text printed,&#xd;\n  rec.encounter_datetime recDt,&#xd;\n  CONCAT(rec_un.given_name, &apos; &apos;, rec_un.family_name, &apos; (&apos;, rec_u.username, &apos;)&apos;) AS recUserName,&#xd;\n  dos.identifier AS dossierNo,&#xd;\n  pmt_n.name AS paymentStatus,&#xd;\n  receipt.value_text AS receiptNo,&#xd;\n  dx.encounter_datetime dxDt,&#xd;\n  CONCAT(dx_un.given_name, &apos; &apos;, dx_un.family_name, &apos; (&apos;, dx_u.username, &apos;)&apos;) AS dxUserName,&#xd;\n  dxc_n.name AS codedName,&#xd;\n  dxn.value_text as nonCodedName,&#xd;\n  recc.num numRec,&#xd;\n  a.state_province Departement, a.city_village Commune, a.address3 Section, a.address1 Locality, a.address2 address&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN patient_identifier zlemr ON p.patient_id = zlemr.patient_id AND zlemr.identifier_type = 8 AND zlemr.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN patient_identifier epi ON p.patient_id = epi.patient_id AND epi.identifier_type = 12 AND epi.voided = 0&#xd;\n&#xd;\nINNER JOIN (SELECT patient_id, DATE(encounter_datetime) dt FROM encounter WHERE encounter_type IN (12, 13, 14) AND voided = 0 AND encounter_datetime BETWEEN :startDate AND ADDDATE(:endDate,1) AND location_id = :location GROUP BY patient_id, DATE(encounter_datetime)) up ON p.patient_id = up.patient_id&#xd;\n&#xd;\nLEFT OUTER JOIN (SELECT patient_id, COUNT(encounter_id) num FROM encounter WHERE encounter_type = 13 AND voided = 0 GROUP BY patient_id) recc ON p.patient_id = recc.patient_id&#xd;\n&#xd;\nLEFT OUTER JOIN encounter reg ON p.patient_id = reg.patient_id AND reg.encounter_type = 12 AND DATE(reg.encounter_datetime) = up.dt AND reg.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs print ON reg.encounter_id = print.encounter_id AND print.concept_id = 6700&#xd;\n&#xd;\nLEFT OUTER JOIN users reg_u ON reg.creator = reg_u.user_id&#xd;\n&#xd;\nLEFT OUTER JOIN person_name reg_un ON reg_u.person_id = reg_un.person_id&#xd;\n&#xd;\nLEFT OUTER JOIN encounter rec ON p.patient_id = rec.patient_id AND rec.encounter_type = 13 AND DATE(rec.encounter_datetime) = up.dt AND rec.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN users rec_u ON rec.creator = rec_u.user_id&#xd;\n&#xd;\nLEFT OUTER JOIN person_name rec_un ON rec_u.person_id = rec_un.person_id&#xd;\n&#xd;\nLEFT OUTER JOIN patient_identifier dos&#xd;\n  on p.patient_id = dos.patient_id&#xd;\n and dos.identifier_type = 11&#xd;\n and dos.voided = 0&#xd;\n AND DATE(dos.date_created) = up.dt&#xd;\n&#xd;\nLEFT OUTER JOIN obs pmt &#xd;\n  on rec.encounter_id = pmt.encounter_id&#xd;\n and pmt.concept_id = 6537&#xd;\n and pmt.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name pmt_n&#xd;\n  on pmt.value_coded = pmt_n.concept_id &#xd;\n and pmt_n.locale = &apos;en&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs receipt &#xd;\n  on rec.encounter_id = receipt.encounter_id &#xd;\n and receipt.concept_id = 6541&#xd;\n and receipt.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN encounter dx ON p.patient_id = dx.patient_id AND dx.encounter_type = 14 AND DATE(dx.encounter_datetime) = up.dt AND dx.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN users dx_u ON dx.creator = dx_u.user_id&#xd;\n&#xd;\nLEFT OUTER JOIN person_name dx_un ON dx_u.person_id = dx_un.person_id&#xd;\n&#xd;\nLEFT OUTER JOIN obs dxc &#xd;\n  ON dx.encounter_id = dxc.encounter_id &#xd;\n AND dxc.concept_id = 6542&#xd;\n AND dxc.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name dxc_n &#xd;\n  ON dxc.value_coded = dxc_n.concept_id&#xd;\n AND dxc_n.locale = &apos;en&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs dxn &#xd;\n  ON dx.encounter_id = dxn.encounter_id&#xd;\n AND dxn.concept_id = 6543&#xd;\n AND dxn.voided = 0&#xd;\n&#xd;\nINNER JOIN person_address a ON p.patient_id = a.person_id AND a.voided = 0&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY p.patient_id, up.dt&#xd;\n&#xd;\n;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-24 18:45:17',3,'2012-09-18 14:52:23',3,0,NULL,NULL,NULL,'8c38a5aa-0606-4b7e-9150-aed865447611'),(203,'Primary Care Visit - one row per patient per day - data export','Data export for \"Primary Care Visit - one row per patient per day\" SQL dataset definition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"835ca83b-1e06-42c4-bbd3-90292b7832e5\" retired=\"false\">\n  <name>Primary Care Visit - one row per patient per day - data export</name>\n  <description>Data export for &quot;Primary Care Visit - one row per patient per day&quot; SQL dataset definition</description>\n  \n  <dateCreated id=\"3\">2012-04-24 19:02:48 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-04-24 19:03:46 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>203</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"8c38a5aa-0606-4b7e-9150-aed865447611\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-04-24 19:02:48',3,'2012-04-24 19:03:46',3,0,NULL,NULL,NULL,'835ca83b-1e06-42c4-bbd3-90292b7832e5'),(204,'Return patients within a month','The total number of returning patients with a visit in the indicated month and health center.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"f5807779-8436-4369-93af-42cd464464f5\" retired=\"false\">\n  <name>Return patients within a month</name>\n  <description>The total number of returning patients with a visit in the indicated month and health center.</description>\n  \n  <dateCreated id=\"3\">2012-04-24 19:53:05 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-01 13:00:28 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>encounterType</name>\n      <label>Encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>204</id>\n  <sqlQuery>select count(*) as returningPatient &#xd;\n  from encounter e, patient p &#xd;\n where p.patient_id = e.patient_id&#xd;\n   and e.encounter_datetime&#xd;\n       between date_format(:date, &apos;%Y-%m-01&apos;) &#xd;\n           and adddate(date_format(:date, &apos;%Y-%m-01&apos;), interval 1 month)&#xd;\n   and e.patient_id in (&#xd;\n         select distinct(e1.patient_id) &#xd;\n           from encounter e1  &#xd;\n          where e1.encounter_datetime between date_format(:date, &apos;%Y-01-01&apos;) &#xd;\n                and subdate(date_format(:date, &apos;%Y-%m-01&apos;), interval 1 hour)&#xd;\n            and e1.location_id = :location&#xd;\n            and e1.encounter_type = :encounterType&#xd;\n            and e1.voided = 0)&#xd;\n   and e.location_id = :location&#xd;\n   and e.encounter_type = :encounterType&#xd;\n   and e.voided = 0&#xd;\n   and p.voided = 0</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-24 19:53:05',3,'2012-05-01 13:00:28',3,0,NULL,NULL,NULL,'f5807779-8436-4369-93af-42cd464464f5'),(205,'_Mobile Clinic MSPP Monthly health services report','Mobile Clinic MSPP Monthly health services report with section 1 (visits) and 9 (diagnoses)','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"dc913921-99ec-4ccb-8d36-f575df3c319c\" retired=\"false\">\n  <name>_Mobile Clinic MSPP Monthly health services report</name>\n  <description>Mobile Clinic MSPP Monthly health services report with section 1 (visits) and 9 (diagnoses)</description>\n  <dateCreated id=\"2\">2012-04-25 02:17:17 CEST</dateCreated>\n  <changedBy id=\"3\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateChanged id=\"4\">2013-03-21 22:34:00 CET</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Month</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>205</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>returnVisits</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" uuid=\"f5807779-8436-4369-93af-42cd464464f5\"/>\n        <parameterMappings id=\"11\">\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>date</string>\n            <string>${date}</string>\n 