rs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>minAge</name>\n      <label>Minimum age</label>\n      <type>java.lang.Integer</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>maxAge</name>\n      <label>Maximum age</label>\n      <type>java.lang.Integer</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>encounterType</name>\n      <label>Encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>209</id>\n  <sqlQuery>select count(e.encounter_id) as monthlyVisitByAge&#xd;\n&#xd;\nfrom encounter e&#xd;\n&#xd;\ninner join patient p&#xd;\n   on e.patient_id = p.patient_id&#xd;\n  and p.voided = 0&#xd;\n&#xd;\ninner join person pr&#xd;\n   on e.patient_id = pr.person_id &#xd;\n  and floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) &#xd;\n         between :minAge and :maxAge&#xd;\n  and pr.birthdate is NOT NULL &#xd;\n&#xd;\nwhere e.encounter_type = :encounterType&#xd;\n  and e.location_id = :location&#xd;\n  and date(e.encounter_datetime) &#xd;\n       between date_format(:date, &apos;%Y-%m-01&apos;) &#xd;\n           and date_add(date_format(:date, &apos;%Y-%m-01&apos;), interval 1 month)&#xd;\n  and e.voided = 0</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-25 12:33:01',3,'2012-05-01 13:03:29',3,0,NULL,NULL,NULL,'fa4fc4a1-93c6-48ab-90ed-f069e5e463c7'),(210,'_Coded primary care diagnoses','Data set of all primary care coded diagnoses','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"6eda4ee2-4547-4e10-936a-524ccb039a97\" retired=\"false\">\n  <name>_Coded primary care diagnoses</name>\n  <description>Data set of all primary care coded diagnoses</description>\n  <dateCreated id=\"2\">2012-04-25 17:42:18 CEST</dateCreated>\n  <changedBy id=\"3\" uuid=\"00102b99-320d-47fa-95cb-8bb449082652\"/>\n  <dateChanged id=\"4\">2013-04-05 11:52:56 CEST</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>location</name>\n      <label>location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>210</id>\n  <sqlQuery>SELECT zlemr.identifier zlemr, pr.gender, ROUND(DATEDIFF(pc.encounter_datetime, pr.birthdate)/365.25, 2) age, MONTH(pc.encounter_datetime) eMonth, WEEKDAY(pc.encounter_datetime) eWeekDay, DATE(pc.encounter_datetime) eDate, dxc_n.name codedName&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN patient_identifier zlemr ON p.patient_id = zlemr.patient_id AND zlemr.identifier_type = 14 AND zlemr.voided = 0&#xd;\n&#xd;\nINNER JOIN encounter pc ON p.patient_id = pc.patient_id AND pc.encounter_type = 19 AND pc.voided = 0 AND pc.location_id = :location AND pc.encounter_datetime between :startDate AND ADDDATE(:endDate,1)&#xd;\n&#xd;\nINNER JOIN obs dxc ON pc.encounter_id = dxc.encounter_id AND dxc.concept_id = 6542 AND dxc.voided = 0&#xd;\n&#xd;\nINNER JOIN concept_name dxc_n ON dxc.value_coded = dxc_n.concept_id AND dxc_n.locale = &apos;en&apos;&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY dxc.obs_id;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-25 17:42:18',3,'2013-04-05 11:52:56',3,0,NULL,NULL,NULL,'6eda4ee2-4547-4e10-936a-524ccb039a97'),(211,'_Non-coded primary care diagnoses','Data set of all non-coded primary care diagnoses','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"685c4119-db60-44b6-83a8-b334e9ef263e\" retired=\"false\">\n  <name>_Non-coded primary care diagnoses</name>\n  <description>Data set of all non-coded primary care diagnoses</description>\n  <dateCreated id=\"2\">2012-04-25 18:35:39 CEST</dateCreated>\n  <changedBy id=\"3\" uuid=\"00102b99-320d-47fa-95cb-8bb449082652\"/>\n  <dateChanged id=\"4\">2013-04-05 14:12:38 CEST</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>location</name>\n      <label>location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>211</id>\n  <sqlQuery>SELECT zlemr.identifier zlemr, pr.gender, ROUND(DATEDIFF(pc.encounter_datetime, pr.birthdate)/365.25, 2) age, MONTH(pc.encounter_datetime) eMonth, WEEKDAY(pc.encounter_datetime) eWeekDay, DATE(pc.encounter_datetime) eDate, dxnc.value_text nonCoded&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr ON p.patient_id = pr.person_id&#xd;\n&#xd;\nINNER JOIN patient_identifier zlemr ON p.patient_id = zlemr.patient_id AND zlemr.identifier_type = 14 AND zlemr.voided = 0&#xd;\n&#xd;\nINNER JOIN encounter pc ON p.patient_id = pc.patient_id AND pc.encounter_type = 19 AND pc.voided = 0 AND pc.location_id = :location AND pc.encounter_datetime between :startDate AND ADDDATE(:endDate,1)&#xd;\n&#xd;\nINNER JOIN obs dxnc ON pc.encounter_id = dxnc.encounter_id AND dxnc.concept_id = 6543 AND dxnc.voided = 0&#xd;\n&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY dxnc.obs_id;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-25 18:35:39',3,'2013-04-05 14:12:38',3,0,NULL,NULL,NULL,'685c4119-db60-44b6-83a8-b334e9ef263e'),(212,'_Coded primary care diagnoses data export','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"278e23a2-d72a-4ea1-b041-0cff871914f0\" retired=\"false\">\n  <name>_Coded primary care diagnoses data export</name>\n  <description></description>\n  <dateCreat