s.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>diagnosisQuestion</name>\n      <label>ZL diagnosis question</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>encounterType</name>\n      <label>Type of encounter</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>214</id>\n  <sqlQuery>select count(*) as total, &#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) = 0),1,0)),0) as babyF,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) = 0),1,0)),0) as babyM,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 1 and 4) ,1,0)),0) as todF,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 1 and 4) ,1,0)),0) as todM,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 5 and 9) ,1,0)),0) as ped5to9F,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 5 and 9) ,1,0)),0) as ped5to9M,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 10 and 14),1,0)),0) as ped10to14F,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 10 and 14),1,0)),0) as ped10to14M,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 15 and 24),1,0)),0) as y15to24F,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 15 and 24),1,0)),0) as y15to24M,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 25 and 49),1,0)),0) as a25to49F,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 25 and 49),1,0)),0) as a25to49M,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 50 and 120),1,0)),0) as a50F,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 50 and 120),1,0)),0) as a50M,&#xd;\n       ifnull(sum(if(pr.gender=&apos;F&apos;,1,0)),0) as totalF,&#xd;\n       ifnull(sum(if(pr.gender=&apos;M&apos;,1,0)),0) as totalM,&#xd;\n       :diagnosis as diagnosisConceptId &#xd;\n&#xd;\nfrom obs o&#xd;\n&#xd;\ninner join encounter e&#xd;\n   ON o.encounter_id = e.encounter_id&#xd;\n  and e.location_id = :location&#xd;\n  and date(e.encounter_datetime) &#xd;\n       between date_format(:date, &apos;%Y-%m-01&apos;) &#xd;\n           and date_add(date_format(:date, &apos;%Y-%m-01&apos;), interval 1 month)&#xd;\n  and e.encounter_type = :encounterType&#xd;\n  and e.voided = 0&#xd;\n&#xd;\ninner join patient p&#xd;\n   on e.patient_id = p.patient_id&#xd;\n  and p.voided = 0&#xd;\n&#xd;\ninner join person pr&#xd;\n   on e.patient_id = pr.person_id &#xd;\n  and pr.birthdate is NOT NULL &#xd;\n&#xd;\nwhere o.value_coded = :diagnosis&#xd;\n  and o.concept_id = :diagnosisQuestion&#xd;\n  and o.voided = 0</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-25 15:22:16',3,'2012-05-14 09:49:26',3,0,NULL,NULL,NULL,'a65e9b9f-cb2b-4128-aefd-1efcc3a6e758'),(215,'Monthly total diagnosis by age, gender and concept question','Monthly total diagnosis by age, gender and question','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"5035935f-3b7e-448e-8b36-c07246a04166\" retired=\"false\">\n  <name>Monthly total diagnosis by age, gender and concept question</name>\n  <description>Monthly total diagnosis by age, gender and question</description>\n  \n  <dateCreated id=\"3\">2012-04-27 10:07:04 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-14 09:46:03 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>encounterType</name>\n      <label>Encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>conceptName</name>\n      <label>Concept question name</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>ignoreDiagnosis</name>\n      <label>Ignore this diagnosis</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>215</id>\n  <sqlQuery>select count(*) as total, &#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) = 0),1,0)),0) as babyF,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) = 0),1,0)),0) as babyM,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 1 and 4) ,1,0)),0) as todF,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 1 and 4) ,1,0)),0) as todM,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 5 and 9) ,1,0)),0) as ped5to9F,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 5 and 9) ,1,0)),0) as ped5to9M,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 10 and 14),1,0)),0) as ped10to14F,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 10 and 14),1,0)),0) as ped10to14M,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 15 and 24),1,0)),0) as y15to24F,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 15 and 24),1,0)),0) as y15to24M,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 25 and 49),1,0)),0) as a25to49F,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 25 and 49),1,0)),0) as a25to49M,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 50 and 120),1,0)),0) as a50F,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 50 and 120),1,0)),0) as a50M,&#xd;\n       ifnull(sum(if(pr.gender=&apos;F&apos;,1,0)),0) as totalF,&#xd;\n       ifnull(sum(if(pr.gender=&apos;M&apos;,1,0)),0) as totalM,&#xd;\n       count(*) as total&#xd;\n&#xd;\nfrom obs o&#xd;\n&#xd;\ninner join encounter e&#xd;\n   ON o.encounter_id = e.encounter_id&#xd;\n  and e.encounter_type = :encounterType&#xd;\n  and e.location_id = :location&#xd;\n  and date(e.encounter_datetime) &#xd;\n       between date_format(:date, &apos;%Y-%m-01&apos;) &#xd;\n           and date_add(date_format(:date, &apos;%Y-%m-01&apos;), interval 1 month)&#xd;\n  and e.voided = 0&#xd;\n&#xd;\ninner join patient p&#xd;\n   on e.patient_id = p.patient_id&#xd;\n  and p.voided = 0&#xd;\n&#xd;\ninner join person pr&#xd;\n   on e.patient_id = pr.person_id &#xd;\n  and pr.birthdate is NOT NULL &#xd;\n&#xd;\nwhere o.concept_id = :conceptName&#xd;\n  and ((o.value_coded &lt;&gt; :ignoreDiagnosis) &#xd;\n      or (o.value_text not like &apos;ras&apos;)&#xd;\n      or (o.value_text not like &apos;%certif%&apos;))&#xd;\n  and o.voided = 0</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-04-27 10:07:04',3,'2012-05-14 09:46:03',3,0,NULL,NULL,NULL,'5035935f-3b7e-448e-8b36-c07246a04166'),(216,'Primary care encounter summary','Numerical summary of the number of encounters (registration, reception, diagnosis) on a given day (potentially compared to an average, for reference), and a list of patients who (a) are missing at least one of these encounters or (b) have a duplicate encounter, run by Archivist Supervisor.  ','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"532a181d-a818-41f7-88dc-88161cc4400a\" retired=\"false\">\n  <name>Primary care encounter summary</name>\n  <description>Numerical summary of the number of encounters (registration, reception, diagnosis) on a given day (potentially compared to an average, for reference), and a list of patients who (a) are missing at least one of these encounters or (b) have a duplicate encounter, run by Archivist Supervisor.  </description>\n  \n  <dateCreated id=\"3\">2012-05-02 15:39:17 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-07-03 13:51:17 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>216</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>missingEncounters</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" uuid=\"3303f85d-9d3c-4555-98b5-548048b3af1e\"/>\n        <parameterMappings id=\"11\">\n          <entry>\n            <string>registrationEncounterType</string>\n            <encounterType id=\"12\" uuid=\"873f968a-73a8-4f9c-ac78-9f4778b751b6\"/>\n          </entry>\n          <entry>\n            <string>zlIdType</string>\n            <patientIdentifierType id=\"13\" uuid=\"a541af1e-105c-40bf-b345-ba1fd6a59b85\"/>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>dossierIdType</string>\n            <patientIdentifierType id=\"14\" uuid=\"e66645eb-03a8-4991-b4ce-e87318e37566\"/>\n          </entry>\n          <entry>\n            <string>receptionEncounterType</string>\n            <encounterType id=\"15\" uuid=\"55a0d3ea-a4d7-4e88-8f01-5aceb2d3c61b\"/>\n          </entry>\n          <entry>\n            <string>date</string>\n            <string>${date}</string>\n          </entry>\n          <entry>\n            <string>primaryCareVisitEncounterType</string>\n            <encounterType id=\"16\" uuid=\"1373cf95-06e8-468b-a3da-360ac1cf026d\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-05-02 15:39:17',3,'2012-07-03 13:51:17',3,0,NULL,NULL,NULL,'532a181d-a818-41f7-88dc-88161cc4400a'),(217,'Duplicate patient count','Count the number of patients who are duplicated based on name (given/family), gender, commune and birthdate.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"b396ad6d-36ad-4fb3-86e8-3bcbf7b3a91c\" retired=\"false\">\n  <name>Duplicate patient count</name>\n  <description>Count the number of patients who are duplicated based on name (given/family), gender, commune and birthdate.</description>\n  \n  <dateCreated id=\"3\">2012-05-07 16:39:41 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-09 16:59:24 EDT</dateChanged>\n  <parameters id=\"5\"/>\n  <id>217</id>\n  <sqlQuery>select sum(row_total) as TotalDuplicateCount&#xd;\n from (select count(*) as row_total &#xd;\n         from patient p, person pe, person_name pn, person_address pa&#xd;\n        where p.patient_id = pe.person_id&#xd;\n          and p.patient_id = pn.person_id&#xd;\n          and p.patient_id = pa.person_id&#xd;\n          and p.voided = 0&#xd;\n          and pe.voided = 0&#xd;\n          and pn.voided = 0&#xd;\n          and pa.voided = 0&#xd;\n        group by pe.gender, pe.birthdate, pn.family_name, pn.given_name, &#xd;\n                 pa.city_village&#xd;\n       having count(*) &gt; 1) as total;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-05-07 16:39:41',3,'2012-05-09 16:59:24',3,0,NULL,NULL,NULL,'b396ad6d-36ad-4fb3-86e8-3bcbf7b3a91c'),(218,'Duplicate patient list','Produce a list of patients who are duplicates based on name (given and family), exact birthdate, commune, and gender.  Need to add score to this.  HAI-311','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"42e59f32-ad42-474d-927e-99a7d910a68b\" retired=\"false\">\n  <name>Duplicate patient list</name>\n  <description>Produce a list of patients who are duplicates based on name (given and family), exact birthdate, commune, and gender.  Need to add score to this.  HAI-311</description>\n  \n  <dateCreated id=\"3\">2012-05-09 17:09:43 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-09 17:21:38 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>dossier</name>\n      <label>Dossier</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>218</id>\n  <sqlQuery>select dos.identifier as Dossier,&#xd;\n       concat(pn.family_name, &apos; &apos;, pn.given_name) as &apos;Patient name&apos;,&#xd;\n       pa.city_village as Commune,&#xd;\n       p.birthdate as Birthdate, &#xd;\n       p.gender as Sex, &#xd;\n       e.encounter_datetime as &apos;Visit date&apos;&#xd;\n  from patient pat&#xd;\n&#xd;\n inner join person p&#xd;\n    on pat.patient_id = p.person_id&#xd;\n   and p.voided = 0&#xd;\n&#xd;\n inner join person_name pn&#xd;\n    on pat.patient_id = pn.person_id&#xd;\n   and pn.voided = 0&#xd;\n&#xd;\n inner join person_address pa&#xd;\n    on pat.patient_id = pa.person_id&#xd;\n   and pa.voided = 0&#xd;\n&#xd;\n inner join patient_identifier dos&#xd;\n   on pat.patient_id = dos.patient_id&#xd;\n  and identifier_type = :dossier&#xd;\n  and dos.voided = 0&#xd;\n&#xd;\n inner join encounter e&#xd;\n   on pat.patient_id = e.patient_id&#xd;\n  and e.location_id = :location&#xd;\n  and e.voided = 0&#xd;\n&#xd;\n inner join &#xd;\n   (select p2.gender as gen, p2.birthdate as bday, &#xd;\n           pn2.family_name as famname, pn2.given_name as givname,&#xd;\n           pa2.city_village as commune&#xd;\n         from person p2, person_name pn2, person_address pa2, patient pat2&#xd;\n        where p2.person_id = pn2.person_id&#xd;\n          and p2.person_id = pa2.person_id&#xd;\n          and p2.person_id = pat2.patient_id&#xd;\n          and p2.voided = 0&#xd;\n          and pn2.voided = 0&#xd;\n          and pa2.voided = 0&#xd;\n          and pat2.voided = 0&#xd;\n        group by p2.gender, p2.birthdate, pn2.family_name, pn2.given_name, &#xd;\n                 pa2.city_village&#xd;\n       having count(*) &gt;= 4) dup&#xd;\n   on p.birthdate = dup.bday&#xd;\n  and p.gender = dup.gen&#xd;\n  and pn.family_name = dup.famname&#xd;\n  and pn.given_name = dup.givname&#xd;\n  and pa.city_village = dup.commune &#xd;\n&#xd;\nwhere pat.voided = 0&#xd;\n&#xd;\ngroup by p.person_id&#xd;\n&#xd;\norder by pn.family_name, pn.given_name, &#xd;\n         p.gender, p.birthdate,&#xd;\n         e.encounter_datetime; </sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-05-09 17:09:43',3,'2012-05-09 17:21:38',3,0,NULL,NULL,NULL,'42e59f32-ad42-474d-927e-99a7d910a68b'),(219,'Total patients with 50 gdes payment','Total number of patients with 50 gdes payment (standard).','org.openmrs.module.reporting.indicator.Indicator','org.openmrs.module.reporting.indicator.CohortIndicator','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.indicator.CohortIndicator id=\"1\" uuid=\"d527f0ec-44b5-4a96-8d30-011b9b6011ca\" retired=\"false\">\n  <name>Total patients with 50 gdes payment</name>\n  <description>Total number of patients with 50 gdes payment (standard).</description>\n  \n  <dateCreated id=\"3\">2012-05-16 14:50:57 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-05-16 14:51:27 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.r