','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"ae418d6f-6e51-4c23-b9ef-3466c65098a9\" retired=\"false\">\n  <name>Missing diagnosis for time period V1</name>\n  <description>A list of patients who have a reception encounter but no visit diagnosis.  Version 1.  For data before January 2013</description>\n  \n  <dateCreated id=\"3\">2012-06-28 17:02:09 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-08-16 15:44:05 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>receptionEncounterType</name>\n      <label>ReceptionEncounterType</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>primaryCareVisitEncounterType</name>\n      <label>PrimaryCareVisitEncounterType</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>startDate</name>\n      <label>StartDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>endDate</name>\n      <label>EndDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"11\">\n      <name>zlIdType</name>\n      <label>ZL EMR IdType</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"12\">\n      <name>dossierIdType</name>\n      <label>Dossier IdType</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>221</id>\n  <sqlQuery>SELECT dossier.identifier as &apos;Dossier&apos;,&#xd;\n       zl.identifier as &apos;ZL EMR ID&apos;,&#xd;\n       concat(n.given_name, &apos; &apos;, n.family_name) as &apos;Non pasyan&apos;,&#xd;\n       pr.gender as Sex, &#xd;\n       date(e.encounter_datetime) as &apos;Dat rendezvous&apos;,&#xd;\n       &apos; &apos; as &apos;Rezon li pat nan sistem nan&apos;&#xd;\n from encounter e&#xd;\n&#xd;\nINNER JOIN person pr &#xd;\n   ON e.patient_id = pr.person_id&#xd;\n  and pr.voided = 0&#xd;\n&#xd;\nINNER JOIN person_name n &#xd;\n   ON e.patient_id = n.person_id&#xd;\n  and n.voided = 0&#xd;\n&#xd;\nINNER JOIN patient p &#xd;\n   ON e.patient_id = p.patient_id&#xd;\n  and p.voided = 0&#xd;\n&#xd;\nleft outer JOIN patient_identifier zl &#xd;\n   ON e.patient_id = zl.patient_id&#xd;\n  AND zl.identifier_type = :zlIdType&#xd;\n  AND zl.voided = 0&#xd;\n&#xd;\nleft outer JOIN patient_identifier dossier &#xd;\n   ON e.patient_id = dossier.patient_id&#xd;\n  AND dossier.identifier_type = :dossierIdType&#xd;\n  AND dossier.voided = 0&#xd;\n&#xd;\n where e.location_id = :location&#xd;\n   and e.voided = 0&#xd;\n   and date(e.encounter_datetime) between :startDate and addDate(:endDate,1)&#xd;\n   and e.encounter_type IN (:receptionEncounterType, :primaryCareVisitEncounterType)&#xd;\n&#xd;\ngroup by date(e.encounter_datetime), e.patient_id &#xd;\n&#xd;\nhaving count(case &#xd;\n             when e.encounter_type = :receptionEncounterType &#xd;\n             then e.patient_id &#xd;\n             else null&#xd;\n             end) &gt; 0&#xd;\n   and count(case &#xd;\n             when e.encounter_type = :primaryCareVisitEncounterType&#xd;\n             then e.patient_id &#xd;\n             else null&#xd;\n             end) = 0;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-06-28 17:02:09',3,'2013-01-24 15:01:27',3,0,NULL,NULL,NULL,'ae418d6f-6e51-4c23-b9ef-3466c65098a9'),(222,'_Missing mobile clinic consultations','A list of patients for a time period where there is a mobile clinic reception encounter, but no consultation.','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"e90652cc-44a8-4359-8a77-b58305155c7f\" retired=\"false\">\n  <name>_Missing mobile clinic consultations</name>\n  <description>A list of patients for a time period where there is a mobile clinic reception encounter, but no consultation.</description>\n  <dateCreated id=\"2\">2012-06-28 23:50:51 CEST</dateCreated>\n  <changedBy id=\"3\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateChanged id=\"4\">2013-03-22 11:34:41 CET</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>222</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>missingDiagnosisDuringPeriod</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"181e8ebe-63fc-4374-9770-64ba8c917b51\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>dossierIdType</string>\n            <patientIdentifierType id=\"13\" uuid=\"08f7f751-4168-473f-903b-3bde8e8a70f6\"/>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>receptionEncounterType</string>\n            <encounterType id=\"14\" uuid=\"35d094f1-d33b-4750-ab86-08213d5af6bb\"/>\n          </entry>\n          <entry>\n            <string>primaryCareVisitEncounterType</string>\n            <encounterType id=\"15\" uuid=\"fec6f3ed-6a3c-4c47-8982-a28f96befb5b\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-06-28 23:50:51',3,'2013-03-22 11:34:41',3,0,NULL,NULL,NULL,'e90652cc-44a8-4359-8a77-b58305155c7f'),(223,'Rehab Scheduled appointments','A list of rehabilitation patients who have scheduled appointments within the indicated time period and location.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"71a49772-0f6e-4275-9ddd-da5b91e89f32\" retired=\"false\">\n  <name>Rehab Scheduled appointments</name>\n  <description>A list of rehabilitation patients who have scheduled appointments within the indicated time period and location.</description>\n  \n  <dateCreated id=\"3\">2012-07-05 09:55:30 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-07-05 11:21:50 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>rehabEncounter</name>\n      <label>Rehab visit type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>zlIdType</name>\n      <label>EMR ZL ID</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"11\">\n      <name>returnVisitConcept</name>\n      <label>Next appointment concept</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>223</id>\n  <sqlQuery>SELECT zl.identifier as &apos;ZL EMR&apos;,&#xd;\n       concat(pn.given_name, &apos; &apos;, pn.family_name) as Name,&#xd;\n       pr.gender as Gender, pr.birthdate,&#xd;\n       date(o.value_datetime) as &apos;Next appointment&apos;&#xd;\n&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN person pr &#xd;\n   ON p.patient_id = pr.person_id&#xd;\n  and pr.voided = 0&#xd;\n&#xd;\nleft outer JOIN patient_identifier zl&#xd;\n   ON p.patient_id = zl.patient_id&#xd;\n  and zl.identifier_type = :zlIdType&#xd;\n  and zl.voided = 0&#xd;\n&#xd;\nINNER JOIN person_name pn&#xd;\n   ON p.patient_id = pn.person_id&#xd;\n  and pn.voided = 0  &#xd;\n&#xd;\nINNER JOIN encounter e&#xd;\n   ON p.patient_id = e.patient_id&#xd;\n  and e.encounter_type = :rehabEncounter&#xd;\n  and e.location_id = :location&#xd;\n  and e.voided = 0&#xd;\n&#xd;\nINNER JOIN obs o&#xd;\n   ON e.encounter_id = o.encounter_id&#xd;\n  and o.concept_id = :returnVisitConcept&#xd;\n  and o.value_datetime BETWEEN :startDate AND adddate(:endDate,1)&#xd;\n  and o.voided = 0 &#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\norder by o.value_datetime;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-07-05 09:55:30',3,'2012-07-05 11:21:50',3,0,NULL,NULL,NULL,'71a49772-0f6e-4275-9ddd-da5b91e89f32'),(224,'Rehab scheduled appointments','A list of rehabilitation patients who have scheduled appointments within the indicated time period and location.','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"e7e719c2-1fdf-4fc6-a1fd-c40b4058cbda\" retired=\"false\">\n  <name>Rehab scheduled appointments</name>\n  <description>A list of rehabilitation patients who have scheduled appointments within the indicated time period and location.</description>\n  \n  <dateCreated id=\"3\">2012-07-05 11:19:08 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-07-05 11:21:23 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>224</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>rehabAppointments</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"71a49772-0f6e-4275-9ddd-da5b91e89f32\"/>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>zlIdType</string>\n            <patientIdentifierType id=\"13\" uuid=\"a541af1e-105c-40bf-b345-ba1fd6a59b85\"/>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>returnVisitConcept</string>\n            <concept id=\"14\" uuid=\"31c6554e-0370-102d-b0e3-001ec94a0cc1\"/>\n          </entry>\n          <entry>\n            <string>rehabEncounter</string>\n            <encounterType id=\"15\" uuid=\"343ca9dd-5576-45ff-bcf4-d8e2f36cab1b\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-07-05 11:19:08',3,'2012-07-05 11:21:23',3,0,NULL,NULL,NULL,'e7e719c2-1fdf-4fc6-a1fd-c40b4058cbda'),(225,'Diagnosis LQAS export','','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"948b2577-6b17-49f6-a77a-f4cc7fefa543\" retired=\"false\">\n  <name>Diagnosis LQAS export</name>\n  <description></description>\n  \n  <dateCreated id=\"3\">2012-07-18 10:16:12 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-07-18 10:21:39 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>225</id>\n  <sqlQuery>SELECT &apos;&apos; as &apos;Dossier Found? Y/N&apos;, d.identifier as &apos;# Dossier&apos;, date(pc.encounter_datetime) as &apos;Visit Date&apos;, cd1n.name as &apos;Coded 1&apos;, cd2n.name  as &apos;Coded 2&apos;, cd3n.name  as &apos;Coded 3&apos;, cd4n.name  as &apos;Coded 4&apos;, nc1.value_text  as &apos;Non-Coded 1&apos;, nc2.value_text  as &apos;Non-Coded 2&apos;, &apos;&apos; as &apos;Dossier&apos;, concat(un.given_name, &quot; &quot;, un.family_name) as &apos;Data Clerk who entered diagnosis&apos;, concat(cln.given_name, &quot; &quot;, cln.family_name) as &apos;Clinician who saw patient&apos;&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN encounter pc ON p.patient_id = pc.patient_id AND pc.encounter_type = (SELECT encounter_type_id FROM encounter_type where uuid = &apos;1373cf95-06e8-468b-a3da-360ac1cf026d&apos;) AND pc.voided = 0 AND pc.encounter_datetime BETWEEN :startDate AND :endDate&#xd;\n&#xd;\nINNER JOIN patient_identifier d ON p.patient_id = d.patient_id AND d.identifier_type = (SELECT patient_identifier_type_id FROM patient_identifier_type WHERE uuid = &apos;e66645eb-03a8-4991-b4ce-e87318e37566&apos;) AND d.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd1 ON pc.encounter_id = cd1.encounter_id AND cd1.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;12e1caf5-0886-4ce3-95d7-77183d8e9892&apos;) AND cd1.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name cd1n ON cd1.value_coded = cd1n.concept_id AND cd1n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd2 ON pc.encounter_id = cd2.encounter_id AND cd2.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;12e1caf5-0886-4ce3-95d7-77183d8e9892&apos;) AND cd2.voided = 0 AND cd2.obs_id != cd1.obs_id&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name cd2n ON cd2.value_coded = cd2n.concept_id AND cd2n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd3 ON pc.encounter_id = cd3.encounter_id AND cd3.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;12e1caf5-0886-4ce3-95d7-77183d8e9892&apos;) AND cd3.voided = 0 AND cd3.obs_id NOT IN (cd1.obs_id, cd2.obs_id)&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name cd3n ON cd3.value_coded = cd3n.concept_id AND cd3n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd4 ON pc.encounter_id = cd4.encounter_id AND cd4.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;12e1caf5-0886-4ce3-95d7-77183d8e9892&apos;) AND cd4.voided = 0 AND cd4.obs_id NOT IN (cd1.obs_id, cd2.obs_id, cd3.obs_id)&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name cd4n ON cd4.value_coded = cd4n.concept_id AND cd4n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs nc1 ON pc.encounter_id = nc1.encounter_id AND nc1.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;84e003b6-04f7-40ae-b31b-90a973dd7b04&apos;) AND nc1.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs nc2 ON pc.encounter_id = nc2.encounter_id AND nc2.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;84e003b6-04f7-40ae-b31b-90a973dd7b04&apos;) AND nc2.voided = 0 AND nc2.obs_id != nc1.obs_id&#xd;\n&#xd;\nINNER JOIN encounter_provider enpr ON pc.encounter_id = enpr.encounter_id AND enpr.voided = 0&#xd;\n&#xd;\nINNER JOIN users u ON enpr.creator = u.user_id&#xd;\n&#xd;\nINNER JOIN person_name un ON u.person_id = un.person_id&#xd;\n&#xd;\nINNER JOIN provider pr ON enpr.provider_id = pr.provider_id&#xd;\n&#xd;\nINNER JOIN person_name cln ON pr.person_id = cln.person_id&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY pc.encounter_id&#xd;\n&#xd;\nORDER BY RAND()&#xd;\nLIMIT 25;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-07-18 10:16:12',3,'2012-12-18 13:10:04',3,0,NULL,NULL,NULL,'948b2577-6b17-49f6-a77a-f4cc7fefa543'),(226,'LQAS 25 diagnosis export','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"e70bd740-1af7-4a57-8c81-d386858c7b9e\" retired=\"false\">\n  <name>LQAS 25 diagnosis export</name>\n  <description></description>\n  \n  <dateCreated id=\"3\">2012-07-18 10:22:02 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-07-18 10:22:44 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>226</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" uuid=\"948b2577-6b17-49f6-a77a-f4cc7fefa543\"/>\n        <parameterMappings id=\"11\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-07-18 10:22:02',3,'2012-09-18 10:30:00',3,0,NULL,NULL,NULL,'e70bd740-1af7-4a57-8c81-d386858c7b9e'),(228,'Patients with a diagnosis','For displaying a list of all patients who have a particular ZL diagnosis (ie.  Yellow fever)','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition id=\"1\" uuid=\"808a7fc6-d471-4c07-b2b2-8e8b6e24f6d9\" retired=\"false\">\n  <name>Patients with a diagnosis</name>\n  <description>For displaying a list of all patients who have a particular ZL diagnosis (ie.  Yellow fever)</description>\n  \n  <dateCreated id=\"3\">2012-08-16 13:18:51 EDT</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>valueList</name>\n      <label>Diagnosis</label>\n      <type>org.openmrs.Concept</type>\n      <collectionType>java.util.List</collectionType>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <timeModifier>ANY</timeModifier>\n  <question id=\"6\" uuid=\"12e1caf5-0886-4ce3-95d7-77183d8e9892\"/>\n  <operator>IN</operator>\n</org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition>','2012-08-16 13:18:51',3,NULL,NULL,0,NULL,NULL,NULL,'808a7fc6-d471-4c07-b2b2-8e8b6e24f6d9'),(229,'Patients with diagnosis','Patients with a particular diagnosis','org.openmrs.module.reporting.indicator.Indicator','org.openmrs.module.reporting.indicator.CohortIndicator','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.indicator.CohortIndicator id=\"1\" uuid=\"52783af7-7f25-4939-85e0-0eac7ba3f2c3\" retired=\"false\">\n  <name>Patients with diagnosis</name>\n  <description>Patients with a particular diagnosis</description>\n  \n  <dateCreated id=\"3\">2012-08-16 13:25:37 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-08-16 13:26:49 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>229</id>\n  <type>COUNT</type>\n  <cohortDefinition id=\"7\">\n    <parameterizable class=\"org.openmrs.module.reporting.cohort.definition.CodedObsCohortDefinition\" id=\"8\" uuid=\"808a7fc6-d471-4c07-b2b2-8e8b6e24f6d9\"/>\n    <parameterMappings id=\"9\">\n      <entry>\n        <string>valueList</string>\n        <concept id=\"10\" uuid=\"3ccca650-26fe-102b-80cb-0017a47871b2\"/>\n      </entry>\n    </parameterMappings>\n  </cohortDefinition>\n</org.openmrs.module.reporting.indicator.CohortIndicator>','2012-08-16 13:25:37',3,'2012-08-16 13:26:49',3,0,NULL,NULL,NULL,'52783af7-7f25-4939-85e0-0eac7ba3f2c3'),(230,'Patient list with yellow fever diagnosis','Produces a list with name, dossier and visit date for all patient diagnoses with Yellow Fever.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"f5fc08b8-272d-4fb8-8702-626e70eaaea1\" retired=\"false\">\n  <name>Patient list with yellow fever diagnosis</name>\n  <description>Produces a list with name, dossier and visit date for all patient diagnoses with Yellow Fever.</description>\n  \n  <dateCreated id=\"3\">2012-08-16 14:43:09 EDT</dateCreated>\n  \n  <dateChanged id=\"4\">2012-08-16 14:48:36 EDT</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>diagnosisQuestion</name>\n      <label>Diagnosis questions</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>diagnosis</name>\n      <label>Diagnosis</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>IdType</name>\n      <label>ID type</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>230</id>\n  <sqlQuery>select cast(pi.identifier as unsigned) as dossierNumber,&#xd;\n       concat(pn.given_name, &apos; &apos;, pn.family_name) as name, &#xd;\n       date(o.obs_datetime) as visitDate&#xd;\nfrom patient p, person_name pn, patient_identifier pi, obs o  &#xd;\nwhere o.person_id = p.patient_id &#xd;\n  and p.patient_id = pn.person_id&#xd;\n  and p.patient_id = pi.patient_id &#xd;\n  and o.location_id = :location&#xd;\n  and o.concept_id = :diagnosisQuestion&#xd;\n  and o.value_coded = :diagnosis&#xd;\n  and pi.identifier_type = :IdType&#xd;\n  and p.voided = 0&#xd;\n  and pi.voided = 0&#xd;\n  and o.voided = 0&#xd;\n  and pn.voided = 0&#xd;\norder by dossierNumber;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-08-16 14:43:09',3,'2012-08-16 14:48:36',3,0,NULL,NULL,NULL,'f5fc08b8-272d-4fb8-8702-626e70eaaea1'),(231,'Provider diagnoses','A list of diagnoses with the provider name and id','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"1f22cb4f-350c-4bb6-80a0-a3afc29cca60\" retired=\"false\">\n  <name>Provider diagnoses</name>\n  <description>A list of diagnoses with the provider name and id</description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>231</id>\n  <sqlQuery>select date(o.obs_datetime) as date, &#xd;\nconcat(pn.given_name, &apos; &apos;, pn.family_name, &apos; (&apos;, pa.value, &apos;)&apos;) as &apos;Provider&apos;,&#xd;\no.value_coded as &apos;Coded diagnosis&apos;,&#xd;\ncn.name&#xd;\nfrom encounter e, obs o, person_name pn, concept_name cn,&#xd;\nencounter_provider ep, provider p, person_attribute pa&#xd;\n&#xd;\nwhere p.person_id IN (select distinct(u.person_id) &#xd;\nfrom users u, user_role ur &#xd;\nwhere u.user_id = ur.user_id &#xd;\nand ur.role = &apos;LacollineProvider&apos;)&#xd;\nand e.encounter_id = o.encounter_id&#xd;\nand e.encounter_id = ep.encounter_id&#xd;\nand ep.provider_id = p.provider_id&#xd;\nand p.person_id = pa.person_id&#xd;\nand o.value_coded = cn.concept_id&#xd;\nand cn.locale_preferred = 1&#xd;\nand cn.locale = &apos;ht&apos;&#xd;\nand p.person_id = pn.person_id&#xd;\nand pa.person_attribute_type_id = 13&#xd;\nand e.location_id = :location&#xd;\nand e.encounter_type = 14&#xd;\nand o.concept_id = 6542&#xd;\nand o.voided = 0&#xd;\nand e.voided = 0&#xd;\nand ep.voided = 0&#xd;\nand date(o.obs_datetime) &gt; :startDate;&#xd;\n&#xd;\n</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-08-29 08:40:07',3,'2012-08-29 08:40:07',3,0,NULL,NULL,NULL,'1f22cb4f-350c-4bb6-80a0-a3afc29cca60'),(232,'_Implausible diagnoses for age','There are a bunch of diseases that are not accurate for different ages (ie.  congenital syphylis, tetanus, conjunctivitis).  This will test for those.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"a2e62d7e-4ef5-427c-9853-6a084b7eb220\" retired=\"false\">\n  <name>_Implausible diagnoses for age</name>\n  <description>There are a bunch of diseases that are not accurate for different ages (ie.  congenital syphylis, tetanus, conjunctivitis).  This will test for those.</description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>visitEncounterType</name>\n      <label>Visit encounter</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>dossierIdentifier</name>\n      <label>Dossier number</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>codedDiagnosisQ</name>\n      <label>ZL diagnosis</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>congenitalSyphilis</name>\n      <label>Congenital Syphilis</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>neonatalTetanus</name>\n      <label>Neonatal tetanus</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>neonatalConjunctivitis</name>\n      <label>Neonatal conjunctivitis</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>232</id>\n  <sqlQuery>select floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) as Age,&#xd;\n       concat(pn.given_name, &apos; &apos;, pn.family_name) as &apos;Patient name&apos;,&#xd;\n       pi.identifier as Dossier,&#xd;\n       case o.value_coded&#xd;\n         when :congenitalSyphilis then &apos;Congenital syphilis&apos;&#xd;\n         when :neonatalTetanus then &apos;Neonatal tetanus&apos;&#xd;\n         when :neonatalConjunctivitis then &apos;Neonatal conjunctivitis&apos; end as diagnosis,&#xd;\n       date(e.encounter_datetime) as &apos;Encounter date&apos;,&#xd;\n       concat(upn.given_name, &apos; &apos;, upn.family_name) as Creator,&#xd;\n       date(e.date_created) as &apos;Date created&apos;&#xd;\n &#xd;\nfrom obs o&#xd;\n&#xd;\ninner join encounter e&#xd;\n   ON o.encounter_id = e.encounter_id&#xd;\n  and e.location_id = :location&#xd;\n  and date(e.encounter_datetime) &gt; :startDate&#xd;\n  and e.encounter_type = :visitEncounterType&#xd;\n  and e.voided = 0&#xd;\n&#xd;\ninner join patient p&#xd;\n   on e.patient_id = p.patient_id&#xd;\n  and p.voided = 0&#xd;\n&#xd;\ninner join person pr&#xd;\n   on e.patient_id = pr.person_id &#xd;\n  and pr.birthdate is NOT NULL &#xd;\n  and floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) &gt; 0&#xd;\n&#xd;\ninner join person_name pn&#xd;\n   on e.patient_id = pn.person_id&#xd;\n  and pn.voided = 0&#xd;\n&#xd;\ninner join patient_identifier pi&#xd;\n   on e.patient_id = pi.patient_id&#xd;\n  and pi.identifier_type = :dossierIdentifier&#xd;\n  and pi.voided = 0&#xd;\n&#xd;\ninner join users u&#xd;\n   on e.creator = u.user_id&#xd;\n&#xd;\ninner join person_name upn&#xd;\n   on u.person_id = upn.person_id&#xd;\n  and upn.voided = 0&#xd;\n&#xd;\nwhere o.value_coded IN (:congenitalSyphilis, :neonatalTetanus, :neonatalConjunctivitis)&#xd;\n  and o.concept_id = :codedDiagnosisQ&#xd;\n  and o.voided = 0;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2013-02-27 11:20:38',3,'2013-02-27 11:20:38',3,0,NULL,NULL,NULL,'a2e62d7e-4ef5-427c-9853-6a084b7eb220'),(233,'_Implausible diagnoses for age','Show  patient information when there are implausible diagnoses for the patient\'s age.','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"81fab0c8-33b6-427c-9fdd-9af84ae1888c\" retired=\"false\">\n  <name>_Implausible diagnoses for age</name>\n  <description>Show  patient information when there are implausible diagnoses for the patient&apos;s age.</description>\n  <changedBy id=\"2\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateChanged id=\"3\">2013-03-21 22:38:36 CET</dateChanged>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>233</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"7\">\n    <entry>\n      <string>implausibleDiagnoses</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"8\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"9\" uuid=\"a2e62d7e-4ef5-427c-9853-6a084b7eb220\"/>\n        <parameterMappings id=\"10\">\n          <entry>\n            <string>visitEncounterType</string>\n            <encounterType id=\"11\" uuid=\"fec6f3ed-6a3c-4c47-8982-a28f96befb5b\"/>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>codedDiagnosisQ</string>\n            <concept id=\"12\" uuid=\"12e1caf5-0886-4ce3-95d7-77183d8e9892\"/>\n          </entry>\n          <entry>\n            <string>dossierIdentifier</string>\n            <patientIdentifierType id=\"13\" uuid=\"08f7f751-4168-473f-903b-3bde8e8a70f6\"/>\n          </entry>\n          <entry>\n            <string>neonatalTetanus</string>\n            <concept id=\"14\" uuid=\"124954AAAAAAAAAAAAAAAAAAAAAAAAAAAAAA\"/>\n          </entry>\n          <entry>\n            <string>congenitalSyphilis</string>\n            <concept id=\"15\" uuid=\"143672AAAAAAAAAAAAAAAAAAAAAAAAAAAAAA\"/>\n          </entry>\n          <entry>\n            <string>neonatalConjunctivitis</string>\n            <concept id=\"16\" uuid=\"b07490b1-4d9f-4f54-ada9-a2f2a06436b5\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2013-03-21 22:38:36',3,'2013-03-21 22:38:36',3,0,NULL,NULL,NULL,'81fab0c8-33b6-427c-9fdd-9af84ae1888c'),(234,'Address Summary and Diagnoses Data Export','This report is a collection of several datasets that contain data on addresses and diagnoses that are entered into the primary care and patient registration system, in order to analyze how these match up to the various master address hierarchy sources.','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"d3ea3f40-1b12-4729-9fd0-de1e0daf9a2e\" retired=\"false\">\n  <name>Address Summary and Diagnoses Data Export</name>\n  <description>This report is a collection of several datasets that contain data on addresses and diagnoses that are entered into the primary care and patient registration system, in order to analyze how these match up to the various master address hierarchy sources.</description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>234</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>primaryCareVisits</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" uuid=\"8c38a5aa-0606-4b7e-9150-aed865447611\"/>\n        <parameterMappings id=\"9\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>codedDiagnoses</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" uuid=\"6eda4ee2-4547-4e10-936a-524ccb039a97\"/>\n        <parameterMappings reference=\"9\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>nonCodedDiagnoses</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"12\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"13\" uuid=\"685c4119-db60-44b6-83a8-b334e9ef263e\"/>\n        <parameterMappings reference=\"9\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>fullDiagnosisExport</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"14\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"15\" uuid=\"42eebbb0-5219-40c0-ac5b-dc0b006e6fb0\"/>\n        <parameterMappings id=\"16\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>patientRegistrations</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"17\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"18\" uuid=\"3b221c2d-bbe3-4034-8803-1ba203cc6ef3\"/>\n        <parameterMappings reference=\"16\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-10-16 16:07:07',3,'2012-10-16 16:07:07',3,0,NULL,NULL,NULL,'d3ea3f40-1b12-4729-9fd0-de1e0daf9a2e'),(235,'Reception Encounters with provider information V1','number of patients who had a reception encounter (among with other things).  Version 1.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"cfa0f7ae-d55f-4ad2-bf6a-942819523704\" retired=\"false\">\n  <name>Reception Encounters with provider information V1</name>\n  <description>number of patients who had a reception encounter (among with other things).  Version 1.</description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>pcVisit</name>\n      <label>Primary care visit</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>pcReception</name>\n      <label>Primary care reception</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>zlEmrId</name>\n      <label>ZL emr id</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>providerId</name>\n      <label>Provider id</label>\n      <type>org.openmrs.PersonAttributeType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>zlDiagnosisCoded</name>\n      <label>Coded diagnosis</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"11\">\n      <name>zlDiagnosisNonCoded</name>\n      <label>Non-coded diagnosis</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"12\">\n      <name>patientPayment</name>\n      <label>Patient payment</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"13\">\n      <name>fonkoze</name>\n      <label>Fonkoze</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"14\">\n      <name>exempt</name>\n      <label>Exempt</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"15\">\n      <name>paid50Grd</name>\n      <label>Paid 50 gourdes</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"16\">\n      <name>staff</name>\n      <label>Staff member</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"17\">\n      <name>paid50GrdDental</name>\n      <label>Paid 50 gourdes for dental</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"18\">\n      <name>paid100grdMedical</name>\n      <label>Paid 100 gourdes for medical cert</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"19\">\n      <name>paid100grdMarriage</name>\n      <label>Paid 100 gourdes for marriage certificate</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>235</id>\n  <sqlQuery>SELECT  e.patient_id as &apos;PatientId&apos;, &#xd;\n	zl.identifier as &apos;ZL EMR ID&apos;, &#xd;\n	n.given_name as FirstName, &#xd;\n	n.family_name as LastName, &#xd;\n	p.gender as Gender, &#xd;\n	e.encounter_datetime as &apos;ReceptionDateTime&apos;,&#xd;\n        case when o1.value_coded = :fonkoze then &apos;Fonkoze&apos; &#xd;\n	     when o1.value_coded = :paid50Grd then &apos;Paid 50 gourdes&apos;&#xd;\n	     when o1.value_coded = :staff then &apos;Staff Member&apos;&#xd;\n	     when o1.value_coded = :exempt then &apos;Exempt&apos;&#xd;\n	     when o1.value_coded = :paid100grdMedical then &apos;Paid 100 gourdes (medical certificate)&apos;&#xd;\n	     when o1.value_coded = :paid100grdMarriage then &apos;Paid 100 gourdes for marriage certificate&apos;&#xd;\n	     when o1.value_coded = :paid50GrdDental then &apos;Paid 50 gourdes (dental)&apos;&#xd;\n	     else &apos;Other&apos;  &#xd;\n	end as &apos;PaymentType&apos;, &#xd;\n	date(e2.encounter_datetime) as &apos;PrimaryCareVisitDateTime&apos;,&#xd;\n        case when (o2.value_coded is not null) then &#xd;\n                (select cn.name &#xd;\n		from concept c, concept_name cn&#xd;\n		where c.concept_id = cn.concept_id &#xd;\n		and c.concept_id = o2.value_coded&#xd;\n                and cn.voided = 0 &#xd;\n		and cn.locale_preferred = 0 &#xd;\n		and cn.locale = &apos;en&apos; &#xd;\n		and cn.concept_name_type = &apos;FULLY_SPECIFIED&apos;)&#xd;\n        else &apos;&apos; &#xd;\n       	end as &apos;CodedDiagnosis&apos;,&#xd;\n        o2.value_coded as &apos;CodedDiagnosis_ConceptId&apos;, &#xd;\n	ifnull(o2.value_text, &apos;&apos;) as NonCodedDiagnosis, &#xd;\n	ep.provider_id as &apos;ProviderId&apos;, &#xd;\n	pv.person_id as &apos;ProviderPersonId&apos;, &#xd;\n	ifnull(concat(pn.given_name, &apos; &apos;, pn.family_name, &apos; (&apos;, pa.value, &apos;)&apos;), &apos;&apos;) as &apos;DoctorName&apos;&#xd;\nFROM encounter e &#xd;\n&#xd;\njoin patient_identifier zl&#xd;\n  on e.patient_id = zl.patient_id&#xd;\n&#xd;\njoin location l &#xd;\n  on e.location_id = l.location_id &#xd;\n&#xd;\njoin person p&#xd;\n  on e.patient_id = p.person_id &#xd;\n&#xd;\njoin person_name n&#xd;\n  on p.person_id=n.person_id  &#xd;\n&#xd;\nleft outer join encounter e2 &#xd;\n  on p.person_id = e2.patient_id&#xd;\n and e2.encounter_type = :pcVisit&#xd;\n and date(e2.encounter_datetime) = date(e.encounter_datetime)&#xd;\n&#xd;\nleft outer join obs o1 &#xd;\n  on e.encounter_id = o1.encounter_id&#xd;\n and o1.concept_id = :patientPayment&#xd;\n and o1.voided = 0&#xd;\n&#xd;\nleft outer join obs o2&#xd;\n  on e2.encounter_id = o2.encounter_id&#xd;\n and (o2.concept_id = :zlDiagnosisCoded &#xd;\n   or o2.concept_id = :zlDiagnosisNonCoded)&#xd;\n and o2.voided = 0 &#xd;\n&#xd;\nleft outer join encounter_provider ep&#xd;\n  on ep.encounter_id = e2.encounter_id&#xd;\n and ep.voided = 0&#xd;\n&#xd;\nleft outer join provider pv&#xd;\n  on ep.provider_id = pv.provider_id&#xd;\n&#xd;\nleft outer join person_name pn&#xd;\n  on pv.person_id = pn.person_id&#xd;\n and pn.voided = 0   &#xd;\n&#xd;\nleft outer join person_attribute pa &#xd;\n  on pv.person_id = pa.person_id&#xd;\n and pa.person_attribute_type_id = :providerId&#xd;\n&#xd;\nwhere zl.identifier_type = :zlEmrId &#xd;\n  and l.location_id = :location &#xd;\n  and e.encounter_type = :pcReception&#xd;\n  and date(e.encounter_datetime) &gt;=  :startDate&#xd;\n  and date(e.encounter_datetime) &lt;=  :endDate  &#xd;\n  and p.voided = 0&#xd;\n  and e.voided = 0&#xd;\n&#xd;\ngroup by e.encounter_datetime</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2013-02-02 21:24:03',3,'2013-02-02 21:24:03',3,0,NULL,NULL,NULL,'cfa0f7ae-d55f-4ad2-bf6a-942819523704'),(236,'Reception encounters with provider information','This shows a list of patients who had a reception encounter and visit along with ZL id and provider id (among with other things)','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"0a5cb452-1ef5-44ba-8903-caaba5c409eb\" retired=\"false\">\n  <name>Reception encounters with provider information</name>\n  <description>This shows a list of patients who had a reception encounter and visit along with ZL id and provider id (among with other things)</description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>236</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"5\">\n    <entry>\n      <string>1</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"6\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"7\" uuid=\"e16684c9-6a73-49b7-a286-d60333cec02b\"/>\n        <parameterMappings id=\"8\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n          <entry>\n            <string>patientPayment</string>\n            <conceptNumeric id=\"9\" uuid=\"5d1bc5de-6a35-4195-8631-7322941fe528\"/>\n          </entry>\n          <entry>\n            <string>pcVisit</string>\n            <encounterType id=\"10\" uuid=\"1373cf95-06e8-468b-a3da-360ac1cf026d\"/>\n          </entry>\n          <entry>\n            <string>location</string>\n            <location id=\"11\" uuid=\"23e7bb0d-51f9-4d5f-b34b-2fbbfeea1960\"/>\n          </entry>\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>zlDiagnosisCoded</string>\n            <concept id=\"12\" uuid=\"12e1caf5-0886-4ce3-95d7-77183d8e9892\"/>\n          </entry>\n          <entry>\n            <string>medicalCert</string>\n            <concept id=\"13\" uuid=\"3905ed77-c41c-400e-ba1f-67cee367d4fd\"/>\n          </entry>\n          <entry>\n            <string>marriageCert</string>\n            <concept id=\"14\" uuid=\"8fea306b-a60a-4f58-997e-45d59aa2e979\"/>\n          </entry>\n          <entry>\n            <string>zlEmrId</string>\n            <patientIdentifierType id=\"15\" uuid=\"a541af1e-105c-40bf-b345-ba1fd6a59b85\"/>\n          </entry>\n          <entry>\n            <string>reasonForVisit</string>\n            <concept id=\"16\" uuid=\"36ba7721-fae0-4da4-aef2-7e476cc04bdf\"/>\n          </entry>\n          <entry>\n            <string>outpatientVisit</string>\n            <concept id=\"17\" uuid=\"e6bc8782-838f-491a-a8c1-47af72182010\"/>\n          </entry>\n          <entry>\n            <string>zlDiagnosisNonCoded</string>\n            <concept id=\"18\" uuid=\"84e003b6-04f7-40ae-b31b-90a973dd7b04\"/>\n          </entry>\n          <entry>\n            <string>erVisit</string>\n            <concept id=\"19\" uuid=\"ba5ad9e0-7b29-4975-a894-b12f6d169022\"/>\n          </entry>\n          <entry>\n            <string>providerId</string>\n            <personAttributeType id=\"20\" uuid=\"6de6c415-97a2-4cca-817a-9501cd9ef382\"/>\n          </entry>\n          <entry>\n            <string>pcReception</string>\n            <encounterType id=\"21\" uuid=\"55a0d3ea-a4d7-4e88-8f01-5aceb2d3c61b\"/>\n          </entry>\n          <entry>\n            <string>dentalVisit</string>\n            <concept id=\"22\" uuid=\"980a5495-0ee2-4050-9eee-ccff53561e13\"/>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2013-02-02 21:39:45',3,'2013-02-02 21:39:45',3,0,NULL,NULL,NULL,'0a5cb452-1ef5-44ba-8903-caaba5c409eb'),(237,'Full diagnosis export','Returns zlemrid, num_dossier, date of visit, up to four coded diagnoses, up to two non-coded diagnoses, the name of the data clerk who entered the diagnoses, and the name of the provider who saw the patient between two dates.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"42eebbb0-5219-40c0-ac5b-dc0b006e6fb0\" retired=\"false\">\n  <name>Full diagnosis export</name>\n  <description>Returns zlemrid, num_dossier, date of visit, up to four coded diagnoses, up to two non-coded diagnoses, the name of the data clerk who entered the diagnoses, and the name of the provider who saw the patient between two dates.</description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>237</id>\n  <sqlQuery>SELECT p.patient_id, zl.identifier as &apos;emr_id&apos;, d.identifier as &apos;# Dossier&apos;, date(pc.encounter_datetime) as &apos;Visit Date&apos;, cd1n.name as &apos;Coded 1&apos;, cd2n.name  as &apos;Coded 2&apos;, cd3n.name  as &apos;Coded 3&apos;, cd4n.name  as &apos;Coded 4&apos;, nc1.value_text  as &apos;Non-Coded 1&apos;, nc2.value_text  as &apos;Non-Coded 2&apos;, &apos;&apos; as &apos;Dossier&apos;, concat(un.given_name, &quot; &quot;, un.family_name) as &apos;Data Clerck who entered diagnosis&apos;, concat(cln.given_name, &quot; &quot;, cln.family_name) as &apos;Clinician who saw patient&apos;&#xd;\nFROM patient p&#xd;\n&#xd;\nINNER JOIN encounter pc ON p.patient_id = pc.patient_id AND pc.encounter_type = (SELECT encounter_type_id FROM encounter_type where uuid = &apos;1373cf95-06e8-468b-a3da-360ac1cf026d&apos;) AND pc.voided = 0 AND pc.encounter_datetime BETWEEN :startDate AND :endDate&#xd;\n&#xd;\nINNER JOIN patient_identifier d ON p.patient_id = d.patient_id AND d.identifier_type = (SELECT patient_identifier_type_id FROM patient_identifier_type WHERE uuid = &apos;e66645eb-03a8-4991-b4ce-e87318e37566&apos;) AND d.voided = 0&#xd;\n&#xd;\nINNER JOIN patient_identifier zl ON p.patient_id = zl.patient_id AND zl.identifier_type = (SELECT patient_identifier_type_id FROM patient_identifier_type WHERE name = &apos;ZL EMR ID&apos;) AND zl.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd1 ON pc.encounter_id = cd1.encounter_id AND cd1.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;12e1caf5-0886-4ce3-95d7-77183d8e9892&apos;) AND cd1.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name cd1n ON cd1.value_coded = cd1n.concept_id AND cd1n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd2 ON pc.encounter_id = cd2.encounter_id AND cd2.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;12e1caf5-0886-4ce3-95d7-77183d8e9892&apos;) AND cd2.voided = 0 AND cd2.obs_id != cd1.obs_id&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name cd2n ON cd2.value_coded = cd2n.concept_id AND cd2n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd3 ON pc.encounter_id = cd3.encounter_id AND cd3.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;12e1caf5-0886-4ce3-95d7-77183d8e9892&apos;) AND cd3.voided = 0 AND cd3.obs_id NOT IN (cd1.obs_id, cd2.obs_id)&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name cd3n ON cd3.value_coded = cd3n.concept_id AND cd3n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs cd4 ON pc.encounter_id = cd4.encounter_id AND cd4.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;12e1caf5-0886-4ce3-95d7-77183d8e9892&apos;) AND cd4.voided = 0 AND cd4.obs_id NOT IN (cd1.obs_id, cd2.obs_id, cd3.obs_id)&#xd;\n&#xd;\nLEFT OUTER JOIN concept_name cd4n ON cd4.value_coded = cd4n.concept_id AND cd4n.locale = &apos;fr&apos;&#xd;\n&#xd;\nLEFT OUTER JOIN obs nc1 ON pc.encounter_id = nc1.encounter_id AND nc1.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;84e003b6-04f7-40ae-b31b-90a973dd7b04&apos;) AND nc1.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN obs nc2 ON pc.encounter_id = nc2.encounter_id AND nc2.concept_id = (SELECT concept_id FROM concept WHERE uuid = &apos;84e003b6-04f7-40ae-b31b-90a973dd7b04&apos;) AND nc2.voided = 0 AND nc2.obs_id != nc1.obs_id&#xd;\n&#xd;\nLEFT OUTER JOIN encounter_provider enpr ON pc.encounter_id = enpr.encounter_id AND enpr.voided = 0&#xd;\n&#xd;\nLEFT OUTER JOIN users u ON enpr.creator = u.user_id&#xd;\n&#xd;\nLEFT OUTER JOIN person_name un ON u.person_id = un.person_id&#xd;\n&#xd;\nLEFT OUTER JOIN provider pr ON enpr.provider_id = pr.provider_id&#xd;\n&#xd;\nLEFT OUTER JOIN person_name cln ON pr.person_id = cln.person_id&#xd;\n&#xd;\nWHERE p.voided = 0&#xd;\n&#xd;\nGROUP BY pc.encounter_id&#xd;\n;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-10-11 13:55:11',3,'2012-10-11 13:55:11',3,0,NULL,NULL,NULL,'42eebbb0-5219-40c0-ac5b-dc0b006e6fb0'),(238,'master_addresses','Returns the master_addresses table','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"75b3c353-57b7-436b-ad26-edd64bd0e367\" retired=\"false\">\n  <name>master_addresses</name>\n  <description>Returns the master_addresses table</description>\n  <parameters id=\"2\"/>\n  <id>238</id>\n  <sqlQuery>SELECT * FROM master_addresses;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-10-11 12:12:43',3,'2012-10-11 12:12:43',3,0,NULL,NULL,NULL,'75b3