tion\" id=\"10\" uuid=\"42eebbb0-5219-40c0-ac5b-dc0b006e6fb0\"/>\n        <parameterMappings reference=\"8\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n    <entry>\n      <string>3</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"11\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"12\" uuid=\"75b3c353-57b7-436b-ad26-edd64bd0e367\"/>\n        <parameterMappings id=\"13\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2012-10-11 12:18:57',3,'2012-10-11 12:18:57',3,0,NULL,NULL,NULL,'91af260d-a7de-4d0a-8a8d-33dc0f8d8cff'),(240,'Patient Registrations','Simple report for the \'Patient Registrations\' SQL dataset.  Data from this report was sent to Jitka October 2012.','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"e2a90e08-c0bf-4da3-8fb7-50ddfa42a03e\" retired=\"false\">\n  <name>Patient Registrations</name>\n  <description>Simple report for the &apos;Patient Registrations&apos; SQL dataset.  Data from this report was sent to Jitka October 2012.</description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>240</id>