nition.ReportDefinition>','2012-10-11 13:49:19',3,'2012-10-11 13:49:19',3,0,NULL,NULL,NULL,'ff6d0435-65b2-4d27-8cce-90bf7ca69a8c'),(243,'Weekly diagnosis count by age group, gender, and malady','Weekly diagnosis count by age group, gender, and malady.  Ages grouped into <5 years and >= 5 years.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"afb7cd1b-0f44-465e-912e-fe3746dd791a\" retired=\"false\">\n  <name>Weekly diagnosis count by age group, gender, and malady</name>\n  <description>Weekly diagnosis count by age group, gender, and malady.  Ages grouped into &lt;5 years and &gt;= 5 years.</description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>diagnosis</name>\n      <label>Diagnosis</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>diagnosisQuestion</name>\n      <label>ZL diagnosis question</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>encounterType</name>\n      <label>Type of encounter</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>243</id>\n  <sqlQuery>select count(*) as total, &#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 0 and 4) ,1,0)),0) as morbBabyF,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 0 and 4) ,1,0)),0) as morbBabyM,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 5 and 120) ,1,0)),0) as morbAdultF,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 5 and 120) ,1,0)),0) as morbAdultM,&#xd;\n       ifnull(sum(if(pr.gender=&apos;F&apos;,1,0)),0) as totalF,&#xd;\n       ifnull(sum(if(pr.gender=&apos;M&apos;,1,0)),0) as totalM,&#xd;\n       :diagnosis as diagnosisConceptId &#xd;\n&#xd;\nfrom obs o&#xd;\n&#xd;\ninner join encounter e&#xd;\n   ON o.encounter_id = e.encounter_id&#xd;\n  and e.location_id = :location&#xd;\n  and date(e.encounter_datetime) &#xd;\n       between date(:startDate) &#xd;\n           and date_add(date(:startDate), interval 6 day)&#xd;\n  and e.encounter_type = :encounterType&#xd;\n  and e.voided = 0&#xd;\n&#xd;\ninner join patient p&#xd;\n   on e.patient_id = p.patient_id&#xd;\n  and p.voided = 0&#xd;\n&#xd;\ninner join person pr&#xd;\n   on e.patient_id = pr.person_id &#xd;\n  and pr.birthdate is NOT NULL &#xd;\n&#xd;\nwhere o.value_coded = :diagnosis&#xd;\n  and o.concept_id = :diagnosisQuestion&#xd;\n  and o.voided = 0</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-11-02 12:02:52',3,'2012-11-02 12:02:52',3,0,NULL,NULL,NULL,'afb7cd1b-0f44-465e-912e-fe3746dd791a'),(244,'Weekly count of diagnosis pairs, by age group, gender, and malady','Weekly count of diagnosis pairs, by age group and gender.  Ages grouped into <5 years and >= 5 years.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"529954e7-d13e-419e-b1e2-72cee4bacbb6\" retired=\"false\">\n  <name>Weekly count of diagnosis pairs, by age group, gender, and malady</name>\n  <description>Weekly count of diagnosis pairs, by age group and gender.  Ages grouped into &lt;5 years and &gt;= 5 years.</description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>diagnosisQuestion</name>\n      <label>ZL diagnosis question</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>encounterType</name>\n      <label>Type of encounter</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>diagnosis1</name>\n      <label>Diagnosis 1</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>diagnosis2</name>\n      <label>Diagnosis 2</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>244</id>\n  <sqlQuery>select count(*) as total, &#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 0 and 4) ,1,0)),0) as morbBabyF,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 0 and 4) ,1,0)),0) as morbBabyM,&#xd;\n       ifnull(sum(if((pr.gender=&apos;F&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 5 and 120) ,1,0)),0) as morbAdultF,&#xd;\n       ifnull(sum(if((pr.gender=&apos;M&apos;) &#xd;\n           and (floor(datediff(e.encounter_datetime, pr.birthdate)/365.25) between 5 and 120) ,1,0)),0) as morbAdultM,&#xd;\n       ifnull(sum(if(pr.gender=&apos;F&apos;,1,0)),0) as totalF,&#xd;\n       ifnull(sum(if(pr.gender=&apos;M&apos;,1,0)),0) as totalM,&#xd;\n       :diagnosis1 as diagnosisConceptId1,&#xd;\n       :diagnosis2 as diagnosisConceptId2&#xd;\n&#xd;\nfrom obs o&#xd;\n&#xd;\ninner join encounter e&#xd;\n   ON o.encounter_id = e.encounter_id&#xd;\n  and e.location_id = :location&#xd;\n  and date(e.encounter_datetime) &#xd;\n       between date(:startDate) &#xd;\n           and date_add(date(:startDate), interval 6 day)&#xd;\n  and e.encounter_type = :encounterType&#xd;\n  and e.voided = 0&#xd;\n&#xd;\ninner join patient p&#xd;\n   on e.patient_id = p.patient_id&#xd;\n  and p.voided = 0&#xd;\n&#xd;\ninner join person pr&#xd;\n   on e.patient_id = pr.person_id &#xd;\n  and pr.birthdate is NOT NULL &#xd;\n&#xd;\nwhere (o.value_coded = :diagnosis1 OR o.value_coded = :diagnosis2)&#xd;\n  and o.concept_id = :diagnosisQuestion&#xd;\n  and o.voided = 0</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-11-02 12:03:47',3,'2012-11-02 12:03:47',3,0,NULL,NULL,NULL,'529954e7-d13e-419e-b1e2-72cee4bacbb6'),(245,'Date plus 7 days','Given an input date, calculates seven days in the future.','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"097a26ea-5f02-4a20-b23a-015847b7e1d9\" retired=\"false\">  <name>Date plus 7 days</name>  <description>Given an input date, calculates seven days in the future.</description>  <parameters id=\"2\">    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">      <name>date</name>      <label>Date</label>      <type>java.util.Date</type>    </org.openmrs.module.reporting.evaluation.parameter.Parameter>  </parameters>  <id>241</id>  <sqlQuery>SELECT date_format(date_add(date(:date), interval 6 DAY), &apos;%e/%m/%Y&apos;) as DatePlus7d&#xd;FROM location &#xd;LIMIT 1 </sqlQuery></org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2013-01-16 17:29:20',3,'2013-01-16 17:30:39',3,0,NULL,NULL,NULL,'097a26ea-5f02-4a20-b23a-015847b7e1d9'),(246,'_Notifiable Disease Validation Dataset','Subsequent validation report for the Notifiable disease report that would include the following information for all conditions on the list EXCEPT malaria, diarrhea, typhoid and IRA, so the archivist can ensure there was not an entry error before reporting these diseases to MSPP','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"0f8b4cc7-d8da-4df3-b5f7-0864259fce56\" retired=\"false\">\n  <name>_Notifiable Disease Validation Dataset</name>\n  <description>Subsequent validation report for the Notifiable disease report that would include the following information for all conditions on the list EXCEPT malaria, diarrhea, typhoid and IRA, so the archivist can ensure there was not an entry error before reporting these diseases to MSPP</description>\n  <changedBy id=\"2\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateChanged id=\"3\">2013-03-22 11:39:57 CET</dateChanged>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Where the Patient has been seen</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>dossierNumber</name>\n      <label>Dossier number</label>\n      <type>org.openmrs.PatientIdentifierType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>phoneNumber</name>\n      <label>Telephone number</label>\n      <type>org.openmrs.PersonAttributeType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>NotifiableDisease</name>\n      <label>Notifiable Disease Concept Set</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"11\">\n      <name>ExcludedDx1</name>\n      <label>Diagnosis to be excluded from the report 1</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"12\">\n      <name>ExcludedDx2</name>\n      <label>Diagnosis to be excluded from the report 2</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"13\">\n      <name>ExcludedDx3</name>\n      <label>Diagnosis to be excluded from the report 3</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"14\">\n      <name>ExcludedDx4</name>\n      <label>Diagnosis to be excluded from the report 4</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"15\">\n      <name>ExcludedDx5</name>\n      <label>Diagnosis to be excluded from the report 5</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>246</id>\n  <sqlQuery>select (select max(identifier)&#xd;\n          from patient_identifier&#xd;\n         where patient_id = p.patient_id &#xd;\n           and identifier_type = :dossierNumber&#xd;\n           and voided = 0) as &apos;Dossier No&apos;,&#xd;\n	concat(pn.given_name, &apos; &apos;, pn.family_name) as Name,&#xd;\n        concat(pa.city_village,&apos; - &apos;, pa.address1) as &apos;Commune - Locality&apos;,&#xd;\n        pat.value as &apos;Telephone Number&apos;,&#xd;\n        date(e.encounter_datetime) as &apos;Date of Visit&apos;,&#xd;\n	cn.name as Diagnosis, &#xd;\n	concat(nn.given_name, &apos; &apos;, nn.family_name) as &apos;Doctor Name&apos;,         &#xd;\n	concat(un.given_name, &apos; &apos;, un.family_name) as &apos;Clerk Name&apos;&#xd;\n      from patient p&#xd;\ninner join person_name pn on pn.person_id = p.patient_id&#xd;\n                   and pn.voided = 0&#xd;\ninner join person_address pa on pa.person_id = p.patient_id&#xd;\n                      and pa.voided = 0&#xd;\nLEFT join person_attribute pat on pat.person_id = p.patient_id&#xd;\n                        and pat.person_attribute_type_id = :phoneNumber&#xd;\n                        and pat.voided = 0&#xd;\ninner join encounter e on e.patient_id = p.patient_id&#xd;\n                 and e.voided = 0&#xd;\n                 and date(e.encounter_datetime) between date(:startDate) and date(:endDate)&#xd;\ninner join obs o on o.person_id = p.patient_id&#xd;\n           and o.encounter_id = e.encounter_id&#xd;\n           and o.location_id = :location&#xd;\n           and o.voided = 0&#xd;\ninner join encounter_provider ep on ep.encounter_id = e.encounter_id&#xd;\n                          and ep.voided = 0&#xd;\ninner join provider pr on pr.provider_id = ep.provider_id&#xd;\n&#xd;\ninner join person_name nn on nn.person_id = pr.person_id &#xd;\n&#xd;\ninner join users us on us.user_id = ep.creator&#xd;\n&#xd;\ninner join person_name un on un.person_id = us.person_id&#xd;\n&#xd;\ninner join concept_name cn on cn.concept_id = o.value_coded&#xd;\n&#xd;\nwhere cn.locale = &apos;ht&apos; &#xd;\n  and cn.concept_name_type = &apos;FULLY_SPECIFIED&apos;&#xd;\n  and cn.voided = 0&#xd;\n  and cn.concept_id in (SELECT concept_id FROM concept_set WHERE concept_set = :NotifiableDisease)&#xd;\n  and cn.concept_id NOT IN (:ExcludedDx1, :ExcludedDx2, :ExcludedDx3, :ExcludedDx4, :ExcludedDx5);</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2013-03-22 11:39:57',3,'2013-03-22 11:39:57',3,0,NULL,NULL,NULL,'0f8b4cc7-d8da-4df3-b5f7-0864259fce56'),(247,'_Notifiable Disease Validation Report','Create a subsequent validation report for the Notifiable disease report that would include the following information for all conditions on the list EXCEPT malaria, diarrhea, typhoid and IRA, so the archivist can ensure there was not an entry error before reporting these diseases to MSPP','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"87321e35-442e-43e7-9c67-398815eb9135\" retired=\"false\">\n  <name>_Notifiable Disease Validation Report</name>\n  <description>Create a subsequent validation report for the Notifiable disease report that would include the following information for all conditions on the list EXCEPT malaria, diarrhea, typhoid and IRA, so the archivist can ensure there was not an entry error before reporting these diseases to MSPP</description>\n  <changedBy id=\"2\" uuid=\"5fbd8100-6f68-11e2-afaa-82871dfc9909\"/>\n  <dateChanged id=\"3\">2013-03-22 11:38:41 CET</dateChanged>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.open