mrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>encounterType</name>\n      <label>Patient visit</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>249</id>\n  <sqlQuery>select count(*) as newPatientVisit &#xd;\n  from encounter e, patient p &#xd;\n where p.patient_id = e.patient_id&#xd;\n   and e.encounter_datetime &#xd;\n       between date_format(:startDate, &apos;%Y-%m-%d&apos;) &#xd;\n           and now()&#xd;\n   and e.location_id = :location&#xd;\n   and e.encounter_type = :encounterType&#xd;\n   and e.voided = 0&#xd;\n   and p.voided = 0</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2012-12-19 17:08:43',3,'2012-12-19 17:08:43',3,0,NULL,NULL,NULL,'c2f6c423-f1ea-48ae-9727-f9a642a52a85'),(250,'Outpatient payment receipts V2','This is for creating a list of payment receipts for outpatient (initially in Lacolline).  Version 2','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"aeb3a6ba-a4d3-4ccc-afd5-df6981866ebf\" retired=\"false\">\n  <name>Outpatient payment receipts V2</name>\n  <description>This is for creating a list of payment receipts for outpatient (initially in Lacolline).  Version 2</description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>encounterType</name>\n      <label>Reception encounter type</label>\n      <type>org.openmrs.EncounterType</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>receiptNumber</name>\n      <label>Receipt number</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>amountPaid</name>\n      <label>Amount patient paid</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"9\">\n      <name>reasonForVisit</name>\n      <label>Reason for visit</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"10\">\n      <name>outpatientVisit</name>\n      <label>Standard outpatient visit</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"11\">\n      <name>dentalVisit</name>\n      <label>Dental visit</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"12\">\n      <name>erVisit</name>\n      <label>Emergency room visit</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"13\">\n      <name>marriageCert</name>\n      <label>Marriage certificate visit</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"14\">\n      <name>medCertVisit</name>\n      <label>Medical certificate visit</label>\n      <type>org.openmrs.Concept</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>250</id>\n  <sqlQuery>select &#xd;\n    o.value_text as receiptNo,&#xd;\n     case &#xd;\n        when paid.value_numeric = 0 then &apos;Exonéré&apos;&#xd;\n        when paid.value_numeric &gt; 1 then &apos;Payés&apos;&#xd;\n    end as paymentType,&#xd;\n    paid.value_numeric as totalPaymentCost,&#xd;\n    case&#xd;\n        when reason.value_coded IN &#xd;\n          (:outpatientVisit,:dentalVisit,:erVisit) &#xd;\n        then paid.value_numeric&#xd;\n    end as paymentCost,&#xd;\n    case&#xd;\n        when reason.value_coded = :medCertVisit&#xd;\n        then paid.value_numeric&#xd;\n    end as medCertPaymentCost,&#xd;\n    case&#xd;\n        when reason.value_coded = :marriageCert&#xd;\n        then paid.value_numeric&#xd;\n    end as prenupCertPaymentCost&#xd;\n&#xd;\nfrom obs o&#xd;\n&#xd;\ninner join encounter e&#xd;\n   ON o.encounter_id = e.encounter_id&#xd;\n  and e.location_id = :location&#xd;\n  and e.encounter_type = :encounterType&#xd;\n  and date(e.encounter_datetime) &#xd;\n       between :startDate and addDate(:endDate,1)&#xd;\n  and e.voided = 0&#xd;\n&#xd;\ninner join obs paid&#xd;\n    on paid.obs_group_id = o.obs_group_id&#xd;\n   and paid.concept_id = :amountPaid&#xd;\n   and paid.value_numeric is not null&#xd;\n   and paid.voided = 0&#xd;\n&#xd;\ninner join obs reason&#xd;\n    on reason.obs_group_id = o.obs_group_id&#xd;\n   and reason.concept_id = :reasonForVisit&#xd;\n   and reason.value_coded is not null&#xd;\n   and reason.voided = 0&#xd;\n&#xd;\nwhere o.concept_id = :receiptNumber&#xd;\n  and o.voided = 0;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2013-01-15 20:26:17',3,'2013-01-15 20:26:17',3,0,NULL,NULL,NULL,'aeb3a6ba-a4d3-4ccc-afd5-df6981866ebf'),(251,'Patients who are exempt from payment','This cohort of patients were exempt from payment for services. ','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.NumericObsCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.NumericObsCohortDefinition id=\"1\" uuid=\"de3a9ad6-65b0-4151-95b8-b4f2194a40bf\" retired=\"false\">\n  <name>Patients who are exempt from payment</name>\n  <description>This cohort of patients were exempt from payment for services. </description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>onOrAfter</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>onOrBefore</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>locationList</name>\n      <label>location</label>\n      <type>org.openmrs.Location</type>\n      <collectionType>java.util.List</collectionType>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <timeModifier>ANY</timeModifier>\n  <question class=\"conceptNumeric\" id=\"6\" uuid=\"5d1bc5de-6a35-4195-8631-7322941fe528\"/>\n  <encounterTypeList id=\"7\">\n    <encounterType id=\"8\" uuid=\"55a0d3ea-a4d7-4e88-8f01-5aceb2d3c61b\"/>\n  </encounterTypeList>\n  <operator1>EQUAL</operator1>\n  <value1>0.0</value1>\n</org.openmrs.module.reporting.cohort.definition.NumericObsCohortDefinition>','2013-01-15 20:30:54',3,NULL,NULL,0,NULL,NULL,NULL,'de3a9ad6-65b0-4151-95b8-b4f2194a40bf'),(252,'Patients who have payment status','The cohort of patients who have payment status -- exempt or paid','org.openmrs.module.reporting.cohort.definition.CohortDefinition','org.openmrs.module.reporting.cohort.definition.NumericObsCohortDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.cohort.definition.NumericObsCohortDefinition id=\"1\" uuid=\"9d92aab0-0f96-4c46-b6ea-80281fc61447\" retired=\"false\">\n  <name>Patients who have payment status</name>\n  <description>The cohort of patients who have payment status -- exempt or paid</description>\n  <parameters id=\"2\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"3\">\n      <name>onOrAfter</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"4\">\n      <name>onOrBefore</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>locationList</name>\n      <label>location</label>\n      <type>org.openmrs.Location</type>\n      <collectionType>java.util.List</collectionType>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </par